se\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:337:\"WordPress 6.6.1 is now available! This minor release features 7 bug fixes in Core and 9 bug fixes for the Block Editor. You can review a summary of the maintenance updates in this release by reading the Release Candidate announcement. WordPress 6.6.1 is a short-cycle release. The next major release will be version 6.7 planned [&#8230;]\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:10:\"Tonya Mork\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:5779:\"\n<p><strong>WordPress 6.6.1 is now available!</strong></p>\n\n\n\n<p>This minor release features <a href=\"https://core.trac.wordpress.org/query?status=closed&amp;id=!61692&amp;milestone=6.6.1&amp;group=status&amp;col=id&amp;col=summary&amp;col=owner&amp;col=type&amp;col=priority&amp;col=component&amp;col=version&amp;col=keywords&amp;order=priority\">7 bug fixes in Core</a> and <a href=\"https://core.trac.wordpress.org/ticket/61692#comment:4 \">9 bug fixes for the Block Editor</a>. You can review a summary of the maintenance updates in this release by reading the <a href=\"https://make.wordpress.org/core/2024/07/18/wordpress-6-6-1-rc1-is-now-available/\">Release Candidate announcement</a>.</p>\n\n\n\n<p>WordPress 6.6.1 is a short-cycle release. The next major release will be <a href=\"https://make.wordpress.org/core/6-7/\">version 6.7</a> planned for November 2024.</p>\n\n\n\n<p>If you have sites that support automatic background updates, the update process will begin automatically.</p>\n\n\n\n<p>You can <a href=\"https://wordpress.org/wordpress-6.6.1.zip\">download WordPress 6.6.1 from WordPress.org</a>, or visit your WordPress Dashboard, click “Updates”, and then click “Update Now”.</p>\n\n\n\n<p>For more information on this release, please <a href=\"https://wordpress.org/support/wordpress-version/version-6-6-1\">visit the HelpHub site</a>.</p>\n\n\n\n<h2 class=\"wp-block-heading\">Thank you to these WordPress contributors</h2>\n\n\n\n<p>This release was led by <a href=\"https://profiles.wordpress.org/hellofromTonya\">Tonya Mork</a> and <a href=\"https://profiles.wordpress.org/ellatrix/\">Ella</a>.</p>\n\n\n\n<p>WordPress 6.6.1 would not have been possible without the contributions of the following people. Their asynchronous coordination to deliver maintenance fixes into a stable release is a testament to the power and capability of the WordPress community.</p>\n\n\n\n<p class=\"is-style-wporg-props-long\"><a href=\"//profiles.wordpress.org/jorbin&quot;\">Aaron Jorbin</a>, <a href=\"https://profiles.wordpress.org/aaronrobertshaw\">Aaron Robertshaw</a>, <a href=\"https://profiles.wordpress.org/wildworks\">Aki Hamano</a>, <a href=\"https://profiles.wordpress.org/amitraj2203\">Amit Raj</a>, <a href=\"https://profiles.wordpress.org/atachibana/\">Akira Tachibana</a>, <a href=\"https://profiles.wordpress.org/afercia\">Andrea Fercia</a>, <a href=\"https://profiles.wordpress.org/andrewserong\">Andrew Serong</a>, <a href=\"https://profiles.wordpress.org/annezazu\">annezazu</a>, <a href=\"https://profiles.wordpress.org/ambrosiawt\">Art Smith</a>, <a href=\"https://profiles.wordpress.org/bgardner\">Brian Gardner</a>, <a href=\"https://profiles.wordpress.org/poena\">Carolina Nymark</a>, <a href=\"https://profiles.wordpress.org/cbirdsong\">cbirdsong</a>, <a href=\"https://profiles.wordpress.org/butterflymedia\">Ciprian</a>, <a href=\"https://profiles.wordpress.org/clarktbt\">Clark</a>, <a href=\"https://profiles.wordpress.org/courane01\">Courtney Robertson</a>, <a href=\"https://profiles.wordpress.org/talldanwp\">Daniel Richards</a>, <a href=\"https://profiles.wordpress.org/davidbaumwald\">David Baumwald</a>, <a href=\"https://profiles.wordpress.org/dmsnell\">Dennis Snell</a>, <a href=\"https://profiles.wordpress.org/dd32\">Dion Hulse</a>, <a href=\"https://profiles.wordpress.org/ellatrix\">Ella</a>, <a href=\"https://profiles.wordpress.org/annubis\">Eric-Oliver Mächler</a>, <a href=\"https://profiles.wordpress.org/fabiankaegy\">Fabian Kägy</a>, <a href=\"https://profiles.wordpress.org/mamaduka\">George Mamadashvili</a>, <a href=\"https://profiles.wordpress.org/jsnajdr\">Jarda Snajdr</a>, <a href=\"https://profiles.wordpress.org/audrasjb\">Jb Audras</a>, <a href=\"https://profiles.wordpress.org/joedolson\">Joe Dolson</a>, <a href=\"https://profiles.wordpress.org/joen\">Joen A.</a>, <a href=\"https://profiles.wordpress.org/jonsurrell\">Jon Surrell</a>, <a href=\"https://profiles.wordpress.org/laurelfulford/\">laurelfulford</a><a>, </a><a href=\"https://profiles.wordpress.org/mciampini\">Marco Ciampini</a>, <a href=\"https://profiles.wordpress.org/santosguillamot\">Mario Santos</a>, <a href=\"https://profiles.wordpress.org/markhowellsmead\">Mark Howells-Mead</a>, <a href=\"https://profiles.wordpress.org/mukesh27%20\">Mukesh Panchal</a>, <a href=\"https://profiles.wordpress.org/neotrope\">neotrope</a>, <a href=\"https://profiles.wordpress.org/swissspidy\">Pascal Birchler</a>, <a href=\"https://profiles.wordpress.org/pbiron\">Paul Biron</a>, <a href=\"https://profiles.wordpress.org/ramonopoly\">ramonopoly</a>, <a href=\"https://profiles.wordpress.org/raquelandefeld\">Raquel</a>, <a href=\"https://profiles.wordpress.org/youknowriad\">Riad Benguella</a>, <a href=\"https://profiles.wordpress.org/richtabor\">Rich Tabor</a>, <a href=\"https://profiles.wordpress.org/noisysocks\">Robert Anderson</a>, <a href=\"https://profiles.wordpress.org/SergeyBiryukov\">Sergey Biryukov</a>, <a href=\"https://profiles.wordpress.org/coffee2code/\">Scott Reilly</a>, <a href=\"https://profiles.wordpress.org/sourav08\">Sourav Pahwa</a>, <a href=\"https://profiles.wordpress.org/sabernhardt\">Stephen Bernhardt</a>, <a href=\"https://profiles.wordpress.org/sunil25393\">SunilPrajapati</a>, <a href=\"https://profiles.wordpress.org/hellofromTonya\">Tonya Mork</a>, <a href=\"https://profiles.wordpress.org/up1512001\">up1512001</a>\n</p>\n\n\n\n<h2 class=\"wp-block-heading\">How to contribute</h2>\n\n\n\n<p class=\"is-style-default\">To get involved in WordPress core development, head over to Trac, <a href=\"https://core.trac.wordpress.org/report/6\">pick a ticket</a>, and join the conversation in the <a href=\"https://wordpress.slack.com/archives/C02RQBWTW\">#core</a> and <a href=\"https://wordpress.slack.com/archives/C07BTF54N68\">#6-7-release-leads</a> channels. Need help? Check out the <a href=\"https://make.wordpress.org/core/handbook/\">Core Contributor Handbook</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:30:\"com-wordpress:feed-additions:1\";a:1:{s:7:\"post-id\";a:1:{i:0;a:5:{s:4:\"data\";s:5:\"17567\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:1;a:6:{s:4:\"data\";s:61:\"\n		\n		\n		\n		\n		\n				\n		\n		\n\n					\n										\n					\n		\n		\n\n			\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:4:{s:0:\"\";a:7:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:51:\"WP Briefing: Episode 84: A WordPress 6.6 Sneak Peek\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:73:\"https://wordpress.org/news/2024/07/episode-84-a-wordpress-6-6-sneak-peek/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Mon, 22 Jul 2024 12:00:00 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:2:{i:0;a:5:{s:4:\"data\";s:7:\"Podcast\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:1;a:5:{s:4:\"data\";s:11:\"wp-briefing\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:53:\"https://wordpress.org/news/?post_type=podcast&p=17539\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:256:\"Join WordPress Executive Director, Josepha Haden Chomphosy, as she offers an exclusive preview of the upcoming WordPress 6.6 release, accompanied by special guest Meher Bala, the release\'s coordinator. Don’t miss this opportunity for an insider’s look!\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:9:\"enclosure\";a:1:{i:0;a:5:{s:4:\"data\";s:0:\"\";s:7:\"attribs\";a:1:{s:0:\"\";a:3:{s:3:\"url\";s:51:\"https://wordpress.org/news/files/2024/07/WPB084.mp3\";s:6:\"length\";s:1:\"0\";s:4:\"type\";s:0:\"\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:14:\"Brett McSherry\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:27038:\"\n<p>Join WordPress Executive Director, Josepha Haden Chomphosy, as she offers an exclusive preview of the upcoming WordPress 6.6 release, accompanied by special guest Meher Bala, the release&#8217;s coordinator. Don’t miss this opportunity for an insider’s look!</p>\n\n\n\n<h2 class=\"wp-block-heading\">Credits</h2>\n\n\n\n<p>Host:&nbsp;<a href=\"https://profiles.wordpress.org/chanthaboune/\">Josepha Haden Chomphosy</a><br>Guest:&nbsp;<a href=\"https://profiles.wordpress.org/meher/\">Meher Bala</a><br>Editor:&nbsp;<a href=\"https://profiles.wordpress.org/adamatdayone/\">Adam Daly</a><br>Logo:&nbsp;<a href=\"https://profiles.wordpress.org/javiarce/\">Javier Arce</a><br>Production:&nbsp;<a href=\"https://profiles.wordpress.org/bjmcsherry/\">Brett McSherry</a><br>Song: Fearless First by Kevin MacLeod</p>\n\n\n\n<h2 class=\"wp-block-heading\">Show Notes</h2>\n\n\n\n<ul class=\"wp-block-list\">\n<li><a href=\"https://wordpress.org/download/releases/6-6/\">WordPress 6.6 Download</a></li>\n\n\n\n<li><a href=\"https://make.wordpress.org/core/\">Make WordPress &#8211; Core</a>\n<ul class=\"wp-block-list\">\n<li><a href=\"https://wordpress.slack.com/archives/C02RQBWTW\">WordPress Core Slack</a></li>\n</ul>\n</li>\n\n\n\n<li><strong>Small List of Big Things</strong>\n<ul class=\"wp-block-list\">\n<li><a href=\"https://make.wordpress.org/community/2024/07/04/first-time-attendees/\" target=\"_blank\" rel=\"noreferrer noopener\">First-Time Attendees: A Key Metric of Success for WordPress Events</a>&nbsp;</li>\n\n\n\n<li>The&nbsp;<a href=\"https://make.wordpress.org/docs/2023/04/25/monthly-online-docs-team-contributor-day-starts-april-2023/\" target=\"_blank\" rel=\"noreferrer noopener\">Docs team holds an online Contributor Day</a>&nbsp;every fourth Tuesday.</li>\n\n\n\n<li>Reminder:&nbsp;<a href=\"https://learn.wordpress.org/online-workshops/\" target=\"_blank\" rel=\"noreferrer noopener\">Online workshops</a>&nbsp;are live sessions where you can learn alongside other WordPress enthusiasts.</li>\n\n\n\n<li><a href=\"https://make.wordpress.org/media-corps/2024/07/03/recap-of-the-media-corps-briefing-on-wordpress-6-6/\" target=\"_blank\" rel=\"noreferrer noopener\">Recap of the Media Corps Briefing on WordPress 6.6</a>&nbsp;</li>\n</ul>\n</li>\n\n\n\n<li>Have a question you’d like answered? Submit them to&nbsp;<a href=\"mailto:wpbriefing@WordPress.org\">WPBriefing@WordPress.org</a>.</li>\n</ul>\n\n\n\n<h2 class=\"wp-block-heading\">Transcript</h2>\n\n\n\n<span id=\"more-17539\"></span>\n\n\n\n<p>[00:00:00]&nbsp;<strong>Josepha:</strong>&nbsp;Hello, everyone, and welcome to the WordPress Briefing, the podcast where you can catch quick explanations of some of the ideas behind the WordPress open source project and the community around it, as well as get a small list of big things coming up in the next two weeks. I’m your host, Josepha Haden Chomphosy. Here we go!&nbsp;</p>\n\n\n\n<p>[00:00:28] (Intro Music)&nbsp;</p>\n\n\n\n<p><span style=\"margin: 0px;padding: 0px\">[00:00:40] <strong>Josepha:</strong> </span>Last week, we released WordPress 6.6, and I had a chance to chat with a long-time contributor and member of the Release Squad about it. Today, I have with me Meher, and she was, well I guess I will let her tell us what she did with the release, but at the time of this recording, yesterday we had the WordPress 6.6 release, codenamed &#8216;Dorsey,&#8217; and so Meher, welcome to the WordPress Briefing.</p>\n\n\n\n<p>[00:01:05] <strong>Meher:</strong> Hi, thank you for inviting me. It&#8217;s nice to be here.</p>\n\n\n\n<p><span style=\"margin: 0px;padding: 0px\">[00:01:09]&nbsp;<strong>Josepha:</strong>&nbsp;Why don&#8217;t you tell us a little bit about yourself, what you do in the WordPress project, how long you&#8217;ve been contributing, and then the role that you played in our big, big mid-year release?</span></p>\n\n\n\n<p>[00:01:19] <strong>Meher:</strong> So my name is Meher. I&#8217;m a front-end developer. I&#8217;m also a CEO of KDC. I&#8217;m also a codable expert in WordPress. I started with contributing into the marketing field. Then, slowly, for 5.6, I got to be on the release squad, learned about training, about how the release goes, process happens. From that time onwards, I&#8217;ve been part of marketing or, basically, I&#8217;ve been part of the marketing team for all the releases. For 6.6, I picked to do the Release Coordinator, something different, something new, wanting to know what goes into it.&nbsp;</p>\n\n\n\n<p>[00:02:03] <strong>Josepha:</strong> That is a big leap from like hanging out in marketing to going to be the Release Coordinator. Before we get into the release itself, just what made you think to yourself, I would like to do that? I would like to stand up and wrangle all of these contributors across the world. Make sure we get a release out?</p>\n\n\n\n<p>[00:02:20] <strong>Meher:</strong> I wanted to try something new. Like even in WordCamp, each role is different. So, even in the release, I wanted to try each different things. And like 5.6, I was in documentation. Then, I was in marketing. So then I got used to marketing, so I stick with my, no, I stuck with marketing. </p>\n\n\n\n<p>[00:02:39] <strong>Josepha:</strong> Yeah.</p>\n\n\n\n<p>[00:02:40] <strong>Meher:</strong> So this time, I want to try something different, and I want to see, you know, how easy was it to be a Release Coordinator because it&#8217;s a Release Coordinator, see, you know, it&#8217;s, it&#8217;s a like a big thing coordinating so many people so many different teams going on, working together, and so yeah, it was fun.</p>\n\n\n\n<p>[00:02:58] <strong>Josepha:</strong> Great. I&#8217;m glad that you found it fun. I always worry when people make big shifts. I&#8217;m like, did we put enough documentation to make it clear? Are they going to find it easy to get started or not? And I think you did a really great job with it. So congratulations, since that happened just yesterday, less than 24 hours ago.</p>\n\n\n\n<p>[00:03:16] <strong>Meher:</strong> Yes, less than 24 hours.</p>\n\n\n\n<p>[00:03:21] <strong>Josepha:</strong> Yeah, yeah. So, from your position as the Release Coordinator, what are the biggest, like, one or two features that you really were excited to see get in this release?</p>\n\n\n\n<p>[00:03:32] <strong>Meher:</strong> Oh, one of the biggest features was the style override patterns.</p>\n\n\n\n<p>[00:03:37] <strong>Josepha:</strong> Oh, yeah.</p>\n\n\n\n<p>[00:03:38] <strong>Meher:</strong> Which I found very useful because a lot of people are using patterns. So, you know, patterns override; if you wanna change something on a specific page, it&#8217;s really useful then just to, you know, recreate a second pattern and then to match up and all. And second, which I liked as a user, was the publish box on the post becoming very clear, very, you know, cluster-free, very minimalistic, and just so comfortable that a normal user will actually understand what is there instead of going to each dropdown and figuring out what needs to be done. So, for me, I think as a developer and user, these two are the fun features, which I like, which 6.5 had, so. There are many other features as well. These are the two great features.</p>\n\n\n\n<p>[00:04:28] <strong>Josepha:</strong> Yeah. I mean, I don&#8217;t think that anyone can argue about the importance of making things a little easier to see, a little easier to use. It&#8217;s been a little bit since WordPress was like fall into it easy to use. I feel like we have been the easiest of the robust CMS systems for like a long time. I know I said CMS systems. That&#8217;s like saying pin number. I know that the S in CMS is systems, but anyway, that notwithstanding, we&#8217;ve been the easiest of the complex solutions for a long time, and I think it&#8217;s always great when we, when we take a moment to be like, what could we make a bit easier to just like, no instructions required you get in there and you can tell like, what any individual thing will do without necessarily, like you said, having to go into drop downs and reading a bunch of stuff a little guesswork is okay. And also, it&#8217;s clear that none of it is dangerous. And so I think that&#8217;s, I think that&#8217;s a a good change myself. So, I agree with your assessment.</p>\n\n\n\n<p>[00:05:27] <strong>Josepha:</strong> So the style override patterns, that&#8217;s part of the suite of design tools that we&#8217;re pulling together, right?&nbsp;</p>\n\n\n\n<p>[00:05:33] <strong>Meher:</strong> Yes.</p>\n\n\n\n<p>[00:05:34] <strong>Josepha:</strong> in your experience, you said you&#8217;re the CEO of your company, like in your experience, does that feel like something that&#8217;s super useful for agencies or particularly useful for freelancers, or should it generally be useful for everyone?</p>\n\n\n\n<p>[00:05:47] <strong>Meher:</strong> It will be useful from a small business point to a freelancer as well because we always try, like, in each page, we always, you know, there is some bits repeated, you know, so, patterns makes it easier, and syndicate pattern makes it more easier so that you can just duplicate and have one place to change. And, like, you have ten pages, you have one pattern across ten pages. The 11th page, you want the same pattern, but little change in that. It&#8217;s easier. It&#8217;s good because you can just change on that page, one particular thing and still go in the parent and change other things to reflect in that. So it will be very helpful for freelancers, small agencies. I do see big agencies take advantage of it. So overall, it should help everyone.</p>\n\n\n\n<p>[00:06:35] <strong>Josepha:</strong> Good. Good. I, for one, isn&#8217;t it great when we can get a feature out that mostly is going to help everyone. But I have been especially interested in the features that we&#8217;re trying to get out that help that kind of like small to medium agency area. I feel like we have a lot of folks in the WordPress community who do exactly what you&#8217;re talking about. You&#8217;re getting something together. You have a mostly what you need across your site. You have one style that&#8217;s out there, but there&#8217;s this one area that you want to have a little bit more personality or a little less personality, depending on what your client is looking for, like this one is applying for jobs, and it needs to be a little less exciting or whatever it is.</p>\n\n\n\n<p>[00:07:13] <strong>Josepha:</strong> I think that&#8217;s great that we have that option. So you don&#8217;t have to try to, I don&#8217;t know, hack your way through that. I know that we&#8217;re not a super get-in-there-and hack-on-it sort of group anymore these days, but I love that we still have that feeling of we&#8217;re gonna, we&#8217;re going to make this a safe hacking space for you. Just get in there and make it work. So that&#8217;s excellent. Excellent. So for you, then, personally, cause you wear a lot of hats, you&#8217;ve your front-end developer; you&#8217;re running your company, you&#8217;re working, you&#8217;re a codable expert. You&#8217;ve got all these things. So from your perspective, what is the thing that got into this release that was a surprising, like a diamond in the rough for you, like a surprising good feature when you just thought it was like an important feature at some point? Was there one that seemed like it was a good idea but became a great idea by the time it was out?</p>\n\n\n\n<p>[00:08:00] <strong>Meher:</strong> Oh, I would say style variations because I did not expect the final style variation to be what it is. A theme developer can create the theme, can add styles, can add fonts, can give different design elements to the theme as a normal user when they when someone wants to just pull up a website, but they&#8217;re not good in design, or they don&#8217;t know which font to use. They choose which font, but then it doesn&#8217;t work. So if the theme provides an easy option just to shift the different styles they&#8217;re using and combining with the fonts. It is a much bigger opportunity for everyone because a normal user can just, they have a black and white site. I want to shift to a colorful site. Just go and see what the theme art has given you and shift it. So I think that I was surprised and I like the outcome. I&#8217;m sure my blogger friends also will like it because then they don&#8217;t have to depend on a designer to you know, give them color schemes and stuff.</p>\n\n\n\n<p>[00:09:01] <strong>Josepha:</strong> Yes. Yeah. So unrelated. It&#8217;s only, it&#8217;s kind of related. I shouldn&#8217;t say it&#8217;s unrelated. It&#8217;s all about WordPress. And now it&#8217;s about color palettes. So, I have a new design on my blog. And unfortunately I am the sort of person that does need a designer to tell me what I meant by the thing I thought. <span style=\"margin: 0px;padding: 0px\">And so, like, I had this idea of the sort of color palette that I wanted and was searching for color palettes inside themes, which I was not succeeding at.</span> And eventually I had a designer who was happy to help you figure this out and get something out there. And they got me something that&#8217;s absolutely perfect. It&#8217;s got an excellent color palette and they redid some images for me. So it looks nice and hip and feels kind of modern. I think it&#8217;s great. But the one thing that I consistently felt confident to mess with while I was in there, because I think they did some custom work in there too, is all of the stuff that&#8217;s included in style variations. Like, I&#8217;m not touching colors because I can&#8217;t put colors together to save my life. But I was pleasantly surprised also by that particular feature. It gives you a feeling of I can change the face of this through the fonts or whatever it is. And I think that&#8217;s a nice, a nice thing.</p>\n\n\n\n<p>[00:10:06] <strong>Meher:</strong> And it&#8217;s a, it&#8217;s a perfect combination. Color and font. Because a lot of people don&#8217;t know today&#8217;s time which font is good. Or which font is needed for an industry.&nbsp;</p>\n\n\n\n<p>[00:10:16] <strong>Josepha:</strong> Exactly. Fortunately, I&#8217;m a site manager of one. And so I just had to ask myself if I liked the font and moved on from there. So, oh. So, like I said, as we&#8217;re recording this, we are less than 24 hours past the release. How was your experience with this release? Was it enjoyable? Did it like expand your horizons? Were there surprises in how a release is run?</p>\n\n\n\n<p>[00:10:43] <strong>Meher:</strong> There was no surprises because I&#8217;ve already been a part of a release. So I.</p>\n\n\n\n<p>[00:10:47] <strong>Josepha:</strong> That&#8217;s&nbsp;fair.&nbsp;</p>\n\n\n\n<p>[00:10:49] <strong>Meher:</strong> You know, it&#8217;s depends on what happens on the day. But yes, behind the scenes, following up, just checking in to make sure, are we on time, do we need more time, or what needs, you know, how much more time is required. It was fairly good, I was only clearly concerned about on the day of the release, because there&#8217;s a lot of things to cover.</p>\n\n\n\n<p>[00:11:09] <strong>Josepha:</strong> Yes.&nbsp;</p>\n\n\n\n<p>[00:11:10] <strong>Meher:</strong> Usually, the party of the beta and the RCs finish in less than hour or so. But the final has a lot more detailed steps and many people to ping, to get, you know, them on the day of the release.</p>\n\n\n\n<p>[00:11:24] <strong>Josepha:</strong> Yeah, for folks who have never watched a release happen. So, I think a lot of the folks who listen to this podcast, they find it in the dashboard, they don&#8217;t necessarily contribute to WordPress. But, like, if you&#8217;ve never watched a WordPress release, we have these release parties for every beta that goes out, every release candidate that goes out, and then the general release. And I always find them so fascinating because, we have hundreds of contributors over the course of an individual release. And then we have probably 50, 60 people who show up at, for some of you all, in the middle of the night and are just being directed, like their attention is just being directed here and there.</p>\n\n\n\n<p>[00:12:06] <strong>Josepha:</strong> And I love watching it because I, I&#8217;m always in the release channel. I&#8217;m in the core channel. All of these are in Slack. And then I&#8217;m also in the admin channel where you have to do the flipping of switches and packaging things. And it&#8217;s really interesting to see, almost like a scan of a brain where things are lighting up for various things. <span style=\"margin: 0px;padding: 0px\">Like, you do the pre-testing in the release channel, and then you do the general testing in the core channel.</span> And then we&#8217;ve got like a person who&#8217;s flipping switches in the back, in the admin area to make sure that it all gets together. And it&#8217;s just really interesting to see how it all works. And yeah, it&#8217;s a really fun thing.</p>\n\n\n\n<p>Dear listener, if you have never, if you&#8217;ve never done this, you have another opportunity. And I think the next release is early in November or something. And even if you&#8217;re there as like a spectator, not necessarily ready to take part in the release, sometimes it&#8217;s kind of nice to see how much effort and how many people are showing up to work on any individual release.</p>\n\n\n\n<p><span style=\"margin: 0px;padding: 0px\">[00:13:01]&nbsp;<strong>Josepha:</strong>&nbsp;This was your first time to lead the release parties, though, right?</span></p>\n\n\n\n<p>[00:13:06] <strong>Meher:</strong> Yes. My first time releasing a release party. Also, to the spectators who have never been a part of release, you can just come and say hi. Like, yesterday, on the day of the release, there was one participant who joined for the first time, and she did contribute. And she was amazed by how smooth it went through. And for me, the best part of any release is seeing the green tick when people start testing. So, you know, everything is smooth sailing.</p>\n\n\n\n<p>[00:13:34] <strong>Josepha:</strong> Yes.</p>\n\n\n\n<p>[00:13:34] <strong>Meher:</strong> And we&#8217;ll reach the destination.</p>\n\n\n\n<p>[00:13:36] <strong>Josepha:</strong> Yes. It&#8217;s, it is a real testament to how well and how closely all of these folks can work together, which if you stop and think about the fact that everybody&#8217;s like all over the world, it&#8217;s all across the globe that this is happening. It is why WordPress works, right? All of these people, all of you coming together to do this on behalf of this software. How cool that you had somebody who joined for the first time and then they were able to contribute immediately.</p>\n\n\n\n<p>[00:14:02] <strong>Meher:</strong> Yes.</p>\n\n\n\n<p>[00:14:03] <strong>Josepha:</strong> I love that.&nbsp;</p>\n\n\n\n<p>[00:14:04] <strong>Meher:</strong> Also, there are a lot of folks who&#8217;ve done it. So they&#8217;re always ready to help out. You know, if you&#8217;re stuck somewhere, as a first-time release lead, there were certain questions I had. There are a lot of people to guide you to the right direction or to say, this needs to go here, or you need to tell the audience this. A lot of support you get from the squad itself, plus the people who are not on the squad and who&#8217;ve done this.</p>\n\n\n\n<p>[00:14:29] <strong>Josepha:</strong> Absolutely. I remember the first release that I led I was the coordinator of it and I believe it was 5.0. I believe it was the one that we put Gutenberg in core with, and it was the most terrifying thing I&#8217;d ever done. Not because I hadn&#8217;t been watching these releases happening for years, but because it&#8217;s different participating and watching and then being the person who is like you said, like making sure that things are still going on time that you understand when you need to say, like, there&#8217;s no way that this works for users right now. We have to take it out and all those things. And then, yeah, the day of, the first time that you have to run one of those global meetings, be like, &#8216;everyone, we don&#8217;t have time for this. Move on&#8217;. That&#8217;s always a really hard first time. Well, cool. That&#8217;s so exciting. So I have a last question for you, and that is, you&#8217;ve kind of let us into it, for first-time contributors to a release, especially anyone who&#8217;s thinking about joining the release squad for the first time, do you have any advice, anything that you wish you had been told when you were coming into this?</p>\n\n\n\n<p>[00:15:32] <strong>Meher:</strong> Come with an open mind and come with a thought that there are people to help you. Ask in any channel. There will be someone or the other who will answer you immediately or a little later, depending on the time zone, and will guide you to the right person or right documentation where you can read up because there is a lot of documentation, good documentation on releases, how it handles and what team is needed, what they are supposed to do. So, you, you have a friendly bunch of people. Just ask.</p>\n\n\n\n<p>[00:16:03] <strong>Josepha:</strong> Excellent. I love it. I love that advice. That was really good advice. Don&#8217;t be scared. Everybody has answers, and they want to give them to you. I agree. That is a real strong truth for the WordPress project. Last thoughts: anything you want to share with the WordPress community with our community of listeners here?</p>\n\n\n\n<p>[00:16:20] <strong>Meher:</strong> Looking forward for new people joining the next release and seeing 6.7 new features, which I&#8217;m excited about, collaborative phase three coming into picture and excited about it.</p>\n\n\n\n<p>[00:16:32] <strong>Josepha:</strong> Yeah. So you can come join us, make.WordPress.org/core, or you can join us in the Slack instance. You can go to chat.WordPress.org and get signed up for that. We coordinate all of this in the core channel, and we hope to see every new contributor that&#8217;s been on the fence. We hope you show up. There&#8217;s a new meeting every two weeks just for y&#8217;all. Meher, this has been an excellent conversation. Thank you so much for joining me today.</p>\n\n\n\n<p>[00:16:56] <strong>Meher:</strong> Thank you for having me. It was fun.</p>\n\n\n\n<p>[00:16:58] (Music interlude)&nbsp;</p>\n\n\n\n<p>[00:17:05] <strong>Josepha:</strong> Hopefully, you&#8217;ve had a chance to download the release and try it out on your own sites. As always, if you run into any bugs, let us know so that we can get them in the next point release.</p>\n\n\n\n<p>And that brings us now to our small list of big things. I have a moderate-sized small list. The first one is that WordPress is a reminder, actually. It&#8217;s a lot of reminders this week if I get right down to it, but this first one is a reminder that one of our big-picture goals for 2024 was getting new users into our event series. Our goal, of course, is to warmly welcome more first-time attendees and new users, and future WordPressers at all of our events, and that&#8217;s something that you can help get done. So, for all of our event organizers, or if you have not organized an event yet and would like to, just so that you can meet the fellow WordPressers in your area or, get to grow your own network a little bit. We&#8217;ve got a few best practices that can help you to make sure that you have a good experience for first time attendees. For one, you should always consider some thoughtful event design. Craft your events with some first-time attendees in mind. You have to consider their needs and interests and potential barriers to participation. Second, it helps to have some targeted messaging. Ensure that you have promotional materials that highlight the benefits of attending, but also what new knowledge, skills, or professional connections folks will gain when they come. It&#8217;s also good to share success stories of past first-time attendees. And then just kind of a final note for that on outreach strategies. You should experiment with a range of marketing channels to reach professional new attendees. You can partner with local schools, professional organizations, and online communities who can help to spread the word.</p>\n\n\n\n<p>[00:18:52] <strong>Josepha:</strong> The second thing on our small list of big things is a reminder that the Docs Team holds an online Contributor Day every fourth Tuesday. They&#8217;ve been doing this for about a year now. And I think that it&#8217;s one of the most engaging and fun new contributor experiences we have, which I realize might sound odd for documentation, but it&#8217;s a great team. It&#8217;s got a great number of team reps in it. And they&#8217;re looking for you. They&#8217;re looking out for you to come and join for your first time on a Contributor Day. The next one is actually tomorrow, July 23rd. I&#8217;ll have a link for that in the show notes.</p>\n\n\n\n<p>[00:19:29] <strong>Josepha:</strong> And the third thing on our list is a reminder about online workshops. These are live sessions where you can learn alongside other WordPress enthusiasts, and they&#8217;re, you know, safe spaces where you can come as you are, develop new ideas, explore issues that you&#8217;re having, ask questions, network over shared interests, exchange theories, collaborate, and honestly, thrive on a bit of problem-solving together. New workshops are happening all the time. You can check out the schedule to join in on a live session and even watch some of the previous sessions to see if it&#8217;s for you.&nbsp;</p>\n\n\n\n<p>[00:20:03] <strong>Josepha:</strong> And the final thing on our list is that there is a recap up of the first Media Corps Briefing that was held on June 27th, and it provided media partners with an overview of the Source of Truth and updates that were planned for WordPress 6.6, that was released last week. Obviously, we just talked to Meher about it. But that particular session featured guest Anne McCarthy, who explained and demoed some of the upcoming features and answered a bunch of questions from the participants. The briefing was recorded and published on the WordPress YouTube channel. Apart from the recording, you can also find a summary, the full transcript, and other relevant links from the link in the show notes. </p>\n\n\n\n<p><span style=\"margin: 0px;padding: 0px\">[00:20:42]&nbsp;<strong>Josepha:</strong>&nbsp;And that, my friends, is your small list of big things.</span> Don&#8217;t forget to follow us on your favorite podcast app or subscribe directly on WordPress.org/news. You&#8217;ll get a friendly reminder whenever there&#8217;s a new episode. If you liked what you heard today, share it with a fellow WordPresser. Or, if you had questions about what you heard today, you can share those with me at WPBriefing@WordPress.org. I am your host, Josepha Haden Chomphosy. Thank you for tuning in today for the WordPress Briefing. And I&#8217;m taking a little break from the podcast in August, and so I will see you again, my friends, in September.&nbsp;</p>\n\n\n\n<p>[00:21:15] (Music outro)&nbsp;</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:30:\"com-wordpress:feed-additions:1\";a:1:{s:7:\"post-id\";a:1:{i:0;a:5:{s:4:\"data\";s:5:\"17539\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:2;a:6:{s:4:\"data\";s:66:\"\n		\n		\n		\n		\n		\n				\n		\n		\n		\n		\n\n					\n										\n					\n		\n		\n			\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:4:{s:0:\"\";a:6:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:26:\"WordPress 6.6 “Dorsey”\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:42:\"https://wordpress.org/news/2024/07/dorsey/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 16 Jul 2024 16:51:48 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:4:{i:0;a:5:{s:4:\"data\";s:7:\"General\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:1;a:5:{s:4:\"data\";s:8:\"Releases\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:2;a:5:{s:4:\"data\";s:3:\"6.6\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:3;a:5:{s:4:\"data\";s:8:\"releases\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:35:\"https://wordpress.org/news/?p=17517\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:272:\"Say hello to the latest WordPress! WordPress 6.6 \"Dorsey\" is here to deliver on the promise of a better web with style, finesse, and a suite of enhanced tools to create beautifully coherent design elements and the confidence of automatic rollbacks for your plugin updates.\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:14:\"Matt Mullenweg\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:63454:\"\n<figure class=\"wp-block-image size-large\"><img fetchpriority=\"high\" decoding=\"async\" width=\"1024\" height=\"683\" src=\"https://i0.wp.com/wordpress.org/news/files/2024/07/Release-Edition-Inline-Image-1.png?resize=1024%2C683&#038;ssl=1\" alt=\"\" class=\"wp-image-17529\" srcset=\"https://i0.wp.com/wordpress.org/news/files/2024/07/Release-Edition-Inline-Image-1.png?resize=1024%2C683&amp;ssl=1 1024w, https://i0.wp.com/wordpress.org/news/files/2024/07/Release-Edition-Inline-Image-1.png?resize=300%2C200&amp;ssl=1 300w, https://i0.wp.com/wordpress.org/news/files/2024/07/Release-Edition-Inline-Image-1.png?resize=768%2C512&amp;ssl=1 768w, https://i0.wp.com/wordpress.org/news/files/2024/07/Release-Edition-Inline-Image-1.png?resize=1536%2C1024&amp;ssl=1 1536w, https://i0.wp.com/wordpress.org/news/files/2024/07/Release-Edition-Inline-Image-1.png?resize=2048%2C1365&amp;ssl=1 2048w\" sizes=\"(max-width: 1000px) 100vw, 1000px\" data-recalc-dims=\"1\" /></figure>\n\n\n\n<p>Say hello to WordPress 6.6 “Dorsey,” named after the legendary American Big Band leader, Tommy Dorsey. Renowned for his smooth-toned trombone and compositions, Dorsey’s music captivated audiences with its emotional depth and vibrant energy.</p>\n\n\n\n<p>Let your heart swing, sing, and sway to the deep brass notes of&nbsp;<a href=\"https://open.spotify.com/playlist/37i9dQZF1DZ06evO2TT3Ge?si=d9872e46371c4ed7\" target=\"_blank\" rel=\"noreferrer noopener\">Dorsey’s Big Band sound</a>&nbsp;as you explore the new features and enhancements of WordPress 6.6.</p>\n\n\n\n<h2 class=\"wp-block-heading\">Hello, 6.6!</h2>\n\n\n\n<p>WordPress 6.6 delivers on the promise of a better web by bringing style, finesse, and a suite of creative possibilities to your site-building experience. This version helps you do more with ease, putting enhanced tools at your fingertips and giving you unprecedented power behind the scenes. You will find more ways to create beautiful, coherent design elements across your site, a new layout for quick page previews in the Site Editor, and the safety of automatic rollbacks for failed plugin auto-updates—among many other highlights.</p>\n\n\n\n<p>In addition to the new features, “Dorsey” continues to deliver the performance and accessibility gains you can expect from every WordPress release. Explore what WordPress 6.6 has to offer and get ready to let its features take your sites to new heights.</p>\n\n\n\n<div class=\"wp-block-buttons is-layout-flex wp-block-buttons-is-layout-flex\">\n<div class=\"wp-block-button\"><a class=\"wp-block-button__link wp-element-button\" href=\"https://wordpress.org/wordpress-6.6.zip\" target=\"_blank\" rel=\"noreferrer noopener\">Download WordPress 6.6 “Dorsey”</a></div>\n</div>\n\n\n\n<h2 class=\"wp-block-heading\">What’s inside</h2>\n\n\n\n<h3 class=\"wp-block-heading\">Add more design options to block themes</h3>\n\n\n\n<p>Create color or font sets to multiply design combinations across one theme. These sets offer more contained design possibilities, allowing visual variety within the site’s broader styling guidelines.</p>\n\n\n\n<figure class=\"wp-block-image\"><img decoding=\"async\" src=\"https://lh7-us.googleusercontent.com/docsz/AD_4nXc7Mg7QzTwFiR7NDQLj6p5m4eddq6MtscZYzTh5QeGqB2sLP3T_t2Io2cqA5QuSixyze9ZVWqsDF9ZD7VscWn0TWA6lCG0OgZ4o5Ar_8MgQta8B3vu3VzJQHYREY9NxUb9J8e3BFESmcnbRwg7g6GuFfguU?key=EV-htfbHG-kjLl6r6s-uKA\" alt=\"\" /></figure>\n\n\n\n<h3 class=\"wp-block-heading\">Simplify your workflow with a new layout for pages in the Site Editor</h3>\n\n\n\n<p>See all of your pages and a preview of any selected page with the new side-by-side layout in the Site Editor.</p>\n\n\n\n<figure class=\"wp-block-image\"><img decoding=\"async\" src=\"https://lh7-us.googleusercontent.com/docsz/AD_4nXfdAh-2XaS_6bdw8YcDZMRpkT0O6oWezPzZT3FzKjoWcxhM4ofivJli8eDRs1pO60wJ7F6YjQblSDop_O8MXQKwRlb_-g8CsFPPVb7hY3vEgIBPLb3tDyrvZZhSZL6Zp-ntXQdB2-ixFVoWaY-Empv3hZQ-?key=EV-htfbHG-kjLl6r6s-uKA\" alt=\"\" /></figure>\n\n\n\n<h3 class=\"wp-block-heading\">Auto-update your plugins with peace of mind</h3>\n\n\n\n<p>Enjoy the convenience of plugin auto-updates with the safety of rollbacks if anything goes wrong—offering your site a new level of security, enhanced functionality as it becomes available, and almost no time or bandwidth from you to make it happen.</p>\n\n\n\n<figure class=\"wp-block-image\"><img decoding=\"async\" src=\"https://lh7-us.googleusercontent.com/docsz/AD_4nXc3cOWzosH9yiEDJrkmndXXX4QShj-vVMJJslAlgxCT74ugbYJuRPszdUi2rrCt8fnmZm1fTdJ3DTkKxYh5ImN4b6lvyBI3bsf5nvzWSBtexeldhPGyjYZM4Me1eUzfq9bAzlzlwxVqI5Hf_i9y1NGvKEdc?key=EV-htfbHG-kjLl6r6s-uKA\" alt=\"\" /></figure>\n\n\n\n<h3 class=\"wp-block-heading\">Customize content in synced patterns</h3>\n\n\n\n<p>Make content changes in each instance of a synced pattern while maintaining a consistent style across them. Set these overrides for Heading, Paragraph, Button, and Image blocks when placed in a synced pattern.</p>\n\n\n\n<figure class=\"wp-block-image\"><img decoding=\"async\" src=\"https://lh7-us.googleusercontent.com/docsz/AD_4nXdH_at4lSW3-Slznfn7HTOEp11xKp889JaLIj-JY5zATJbqZhNPM5MIVZzhn7J2gGhqRbkIzjGMhkFzfQFXfLpxoXu2MXDcPMCXaACaucFHph4dMrd8jHCqFckpk0HtJhEI_cWHTRDR0343_Ut06sgNgaOw?key=EV-htfbHG-kjLl6r6s-uKA\" alt=\"\" /></figure>\n\n\n\n<h3 class=\"wp-block-heading\">Performance</h3>\n\n\n\n<p>WordPress 6.6 features important updates like removing redundant WP_Theme_JSON calls, disabling autoload for large options, and eliminating unnecessary polyfill dependencies. Other highlights include lazy-loading post embeds, a new <code>data-wp-on-async</code> directive, and templates in the editor that load approximately 35% faster overall.</p>\n\n\n\n<h3 class=\"wp-block-heading\">Accessibility</h3>\n\n\n\n<p>This release includes 58 accessibility fixes and enhancements. These focus on foundational aspects of the WordPress experience, particularly the data views component powering the new site editing experience and areas like the Inserter, which provide a key way of interacting with blocks and patterns.</p>\n\n\n\n<h3 class=\"wp-block-heading\">And much more</h3>\n\n\n\n<p>Visit the <a href=\"https://wordpress.org/download/releases/6-6/\">feature showcase</a> for a full overview of all the new features and enhancements in WordPress 6.6.</p>\n\n\n\n<div class=\"wp-block-buttons is-layout-flex wp-block-buttons-is-layout-flex\">\n<div class=\"wp-block-button\"><a class=\"wp-block-button__link wp-element-button\" href=\"https://wordpress.org/download/releases/6-6/\">Check out what&#8217;s new</a></div>\n</div>\n\n\n\n<h2 class=\"wp-block-heading\">Learn more about WordPress 6.6</h2>\n\n\n\n<p>Explore <a href=\"https://learn.wordpress.org/\">Learn WordPress</a> for quick how-to videos, <a href=\"https://learn.wordpress.org/social-learning/\">online workshops</a>, and other free resources to level up your WordPress knowledge and skills.</p>\n\n\n\n<p>The <a href=\"https://make.wordpress.org/core/2024/06/25/wordpress-6-6-field-guide/\">WordPress 6.6 Field Guide</a> contains detailed technical information and <a href=\"https://make.wordpress.org/core/tag/dev-notes-6-6/\">developer notes</a> to help you build with WordPress and get the most out of this release. Don’t forget to subscribe to the <a href=\"https://developer.wordpress.org/news/\">Developer Blog</a> for updates, tutorials, and other helpful WordPress content for developers.</p>\n\n\n\n<p>For information about installation, file changes, fixes, and other updates, read the <a href=\"https://wordpress.org/documentation/wordpress-version/version-6-6/\">6.6 release notes</a>.</p>\n\n\n\n<h2 class=\"wp-block-heading\">The 6.6 release squad</h2>\n\n\n\n<p>Every release comes to you from a dedicated team of enthusiastic contributors who help keep things on track and moving smoothly. The team that has led 6.6 is a cross-functional group of contributors who are always ready to champion ideas, remove blockers, and resolve issues.</p>\n\n\n\n<ul class=\"wp-block-list\">\n<li>Release Lead: <a href=\"https://profiles.wordpress.org/matt/\">Matt Mullenweg</a></li>\n\n\n\n<li>Release Coordinator: <a href=\"https://profiles.wordpress.org/meher/\">Meher Bala</a></li>\n\n\n\n<li>Core Tech Lead: <a href=\"https://profiles.wordpress.org/audrasjb/\">Jb Audras</a></li>\n\n\n\n<li>Editor Tech Leads: <a href=\"https://profiles.wordpress.org/ellatrix/\">Ella van Durpe</a>, <a href=\"https://profiles.wordpress.org/vcanales/\">Vicente Canales</a></li>\n\n\n\n<li>Core Triage Leads: <a href=\"https://profiles.wordpress.org/oglekler/\">Olga Gleckler</a>, <a href=\"https://profiles.wordpress.org/nhrrob/\">Nazmul Hasan Robin</a></li>\n\n\n\n<li>Editor Triage Leads: <a href=\"https://profiles.wordpress.org/fabiankaegy/\">Fabian Kägy</a>, <a href=\"https://profiles.wordpress.org/colorful-tones/\">Damon Cook</a>&nbsp;</li>\n\n\n\n<li>Documentation Leads: <a href=\"https://profiles.wordpress.org/juanmaguitar/\">JuanMa Garrido</a>, <a href=\"https://profiles.wordpress.org/jdy68/\">Jenny Dupuy</a>, <a href=\"https://profiles.wordpress.org/josepmoran/\">Josep Morán</a></li>\n\n\n\n<li>Marketing &amp; Communications Lead: <a href=\"https://profiles.wordpress.org/marybaum/\">Mary Baum</a></li>\n\n\n\n<li>Test Lead: <a href=\"https://profiles.wordpress.org/annezazu/\">Anne McCarthy</a></li>\n\n\n\n<li>Design Lead: <a href=\"https://profiles.wordpress.org/richtabor/\">Rich Tabor</a></li>\n\n\n\n<li>Performance Lead: <a href=\"https://profiles.wordpress.org/adamsilverstein/\">Adam Silverstein</a></li>\n</ul>\n\n\n\n<h2 class=\"wp-block-heading\">Thank you, contributors</h2>\n\n\n\n<p>The mission of WordPress is to <a href=\"https://wordpress.org/about/\">democratize publishing</a> and embody the <a href=\"https://opensource.org/osd-annotated\">freedoms that come with open source</a>. A global and diverse community of people collaborating to strengthen the software supports this effort.</p>\n\n\n\n<p>WordPress 6.6 reflects the tireless efforts and passion of more than 630 contributors in at least 51 countries. This release also welcomed over 150 first-time contributors!</p>\n\n\n\n<p>Their collaboration delivered more than 1,900 enhancements and fixes, ensuring a stable release for all—a testament to the power and capability of the WordPress open source community.</p>\n\n\n\n<p class=\"is-style-wporg-props-long alignfull\"><a href=\"https://profiles.wordpress.org/benniledl/\">!Benni</a> · <a href=\"https://profiles.wordpress.org/1naveengiri/\">1naveengiri</a> · <a href=\"https://profiles.wordpress.org/jorbin/\">Aaron Jorbin</a> · <a href=\"https://profiles.wordpress.org/aaronrobertshaw/\">Aaron Robertshaw</a> · <a href=\"https://profiles.wordpress.org/aatanasov/\">aatanasov</a> · <a href=\"https://profiles.wordpress.org/abditsori/\">abditsori</a> · <a href=\"https://profiles.wordpress.org/wpalani/\">Abdulrahman Alani</a> · <a href=\"https://profiles.wordpress.org/webcommsat/\">Abha Thakor</a> · <a href=\"https://profiles.wordpress.org/abhi3315/\">abhi3315</a> · <a href=\"https://profiles.wordpress.org/abhijitrakas/\">Abhijit Rakas</a> · <a href=\"https://profiles.wordpress.org/abitofmind/\">abitofmind</a> · <a href=\"https://profiles.wordpress.org/kawauso/\">Adam Harley (Kawauso)</a> · <a href=\"https://profiles.wordpress.org/adamsilverstein/\">Adam Silverstein</a> · <a href=\"https://profiles.wordpress.org/adamhorne/\">adamhorne</a> · <a href=\"https://profiles.wordpress.org/adeltahri/\">Adel Tahri</a> · <a href=\"https://profiles.wordpress.org/adrianduffell/\">adrianduffell</a> · <a href=\"https://profiles.wordpress.org/aduth/\">aduth</a> · <a href=\"https://profiles.wordpress.org/aezazshekh/\">Aezaz Shekh</a> · <a href=\"https://profiles.wordpress.org/chaion07/\">Ahmed Kabir Chaion</a> · <a href=\"https://profiles.wordpress.org/ajfleming/\">ajfleming</a> · <a href=\"https://profiles.wordpress.org/ajitbohra/\">Ajit Bohra</a> · <a href=\"https://profiles.wordpress.org/ajithrn/\">Ajith R N</a> · <a href=\"https://profiles.wordpress.org/akashdhawade/\">Akash Dhawade</a> · <a href=\"https://profiles.wordpress.org/wildworks/\">Aki Hamano</a> · <a href=\"https://profiles.wordpress.org/atachibana/\">Ak