/a> · <a href=\"https://profiles.wordpress.org/zodiac1978/\">Torsten Landsiedel</a> · <a href=\"https://profiles.wordpress.org/tremidkhar/\">Tremi Dkhar</a> · <a href=\"https://profiles.wordpress.org/truptikanzariya/\">Trupti Kanzariya</a> · <a href=\"https://profiles.wordpress.org/tunetheweb/\">tunetheweb</a> · <a href=\"https://profiles.wordpress.org/twstokes/\">twstokes</a> · <a href=\"https://profiles.wordpress.org/tybor/\">tybor</a> · <a href=\"https://profiles.wordpress.org/u451f/\">u451f</a> · <a href=\"https://profiles.wordpress.org/ugyensupport/\">Ugyen Dorji</a> · <a href=\"https://profiles.wordpress.org/umesh84/\">Umesh Gupta</a> · <a href=\"https://profiles.wordpress.org/up1512001/\">up1512001</a> · <a href=\"https://profiles.wordpress.org/eboxnet/\">Vagelis</a> · <a href=\"https://profiles.wordpress.org/valer1eg/\">Val&#233;rie Galassi</a> · <a href=\"https://profiles.wordpress.org/vcanales/\">Vicente Canales</a> · <a href=\"https://profiles.wordpress.org/szepeviktor/\">Viktor Sz&#233;pe</a> · <a href=\"https://profiles.wordpress.org/vineet2003/\">Vinit</a> · <a href=\"https://profiles.wordpress.org/vinita29/\">Vinita Tandulkar</a> · <a href=\"https://profiles.wordpress.org/vipulgupta003/\">Vipul Gupta</a> · <a href=\"https://profiles.wordpress.org/ashokrane/\">Vishal Kothari</a> · <a href=\"https://profiles.wordpress.org/vivekawsm/\">vivekawsm</a> · <a href=\"https://profiles.wordpress.org/vrrobz/\">vrrobz</a> · <a href=\"https://profiles.wordpress.org/webmandesign/\">WebMan Design &#124; Oliver Juhas</a> · <a href=\"https://profiles.wordpress.org/websitegenii/\">websitegenii</a> · <a href=\"https://profiles.wordpress.org/wesatintellitonic/\">wesatintellitonic</a> · <a href=\"https://profiles.wordpress.org/westonruter/\">Weston Ruter</a> · <a href=\"https://profiles.wordpress.org/whaze/\">whaze</a> · <a href=\"https://profiles.wordpress.org/skorasaurus/\">Will Skora</a> · <a href=\"https://profiles.wordpress.org/earnjam/\">William Earnhardt</a> · <a href=\"https://profiles.wordpress.org/nestea29950/\">WilliamG</a> · <a href=\"https://profiles.wordpress.org/wojtekn/\">Wojtek Naruniec</a> · <a href=\"https://profiles.wordpress.org/wpsoul/\">wpsoul</a> · <a href=\"https://profiles.wordpress.org/yagniksangani/\">Yagnik Sangani</a> · <a href=\"https://profiles.wordpress.org/yankiara/\">yankiara</a> · <a href=\"https://profiles.wordpress.org/collet/\">Yann</a> · <a href=\"https://profiles.wordpress.org/yguyon/\">Yannis Guyon</a> · <a href=\"https://profiles.wordpress.org/fierevere/\">Yui</a> · <a href=\"https://profiles.wordpress.org/yukinobu/\">Yukinobu Asakawa</a> · <a href=\"https://profiles.wordpress.org/yuvrajsinh2211/\">Yuvrajsinh Sisodiya</a> · <a href=\"https://profiles.wordpress.org/zackkrida/\">Zack Krida</a> · <a href=\"https://profiles.wordpress.org/zackkatz/\">zackkatz</a> · <a href=\"https://profiles.wordpress.org/zafarkamal/\">Zafar Kamal</a> · <a href=\"https://profiles.wordpress.org/zeelthakkar/\">zeelthakkar</a> · <a href=\"https://profiles.wordpress.org/zenaulislam/\">Zenaul Islam</a> · <a href=\"https://profiles.wordpress.org/zieladam/\">zieladam</a> · <a href=\"https://profiles.wordpress.org/zkarj/\">zkarj</a> · <a href=\"https://profiles.wordpress.org/zunaid321/\">Zunaid Amin</a></p>\n\n\n\n<p>More than <a href=\"https://translate.wordpress.org/stats/\">60 locales have translated 90 percent</a> or more of WordPress 6.6 into their language. Community translators are working hard to ensure more translations are on their way. Thank you to everyone who helps make WordPress available in 200 languages.</p>\n\n\n\n<p>Last but not least, thanks to the volunteers who contribute to the <a href=\"https://wordpress.org/support/\">support forums</a> by answering questions from WordPress users worldwide.</p>\n\n\n\n<h2 class=\"wp-block-heading\">Get involved</h2>\n\n\n\n<p>Participation in WordPress goes far beyond coding, and learning more and getting involved is easy. Discover the teams that come together to <a href=\"https://make.wordpress.org/\">Make WordPress</a> and use <a href=\"https://make.wordpress.org/contribute/\">this interactive tool</a> to help you decide which is right for you.</p>\n\n\n\n<h2 class=\"wp-block-heading\">6.6 haiku</h2>\n\n\n\n<p>Six-point-six is here.<br>Make it all gorgeous; keep it<br>On brand, and relax.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:30:\"com-wordpress:feed-additions:1\";a:1:{s:7:\"post-id\";a:1:{i:0;a:5:{s:4:\"data\";s:5:\"17517\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:3;a:6:{s:4:\"data\";s:69:\"\n		\n		\n		\n		\n		\n				\n		\n		\n		\n		\n		\n\n					\n										\n					\n		\n		\n			\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:4:{s:0:\"\";a:6:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:33:\"WordPress 6.6 Release Candidate 3\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:69:\"https://wordpress.org/news/2024/07/wordpress-6-6-release-candidate-3/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 09 Jul 2024 17:39:24 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:5:{i:0;a:5:{s:4:\"data\";s:11:\"Development\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:1;a:5:{s:4:\"data\";s:8:\"Releases\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:2;a:5:{s:4:\"data\";s:3:\"6.6\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:3;a:5:{s:4:\"data\";s:11:\"development\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:4;a:5:{s:4:\"data\";s:8:\"releases\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:35:\"https://wordpress.org/news/?p=17497\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:345:\"WordPress 6.6 RC3 is ready for download and testing! This version of the WordPress software is under development. Please do not install, run, or test this version of WordPress on production or mission-critical websites. Instead, please evaluate RC3 on a test server or a local environment. Reaching this phase of the release cycle is a [&#8230;]\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:8:\"marybaum\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:9781:\"\n<p>WordPress 6.6 RC3 is ready for download and testing!</p>\n\n\n\n<p><strong>This version of the WordPress software is under development</strong>.<strong> Please do not install, run, or test this version of WordPress on production or mission-critical websites.</strong> Instead, please evaluate RC3 on a test server or a local environment.</p>\n\n\n\n<p>Reaching this phase of the release cycle is a worthy achievement. While release candidates are considered ready for release, your testing is still vital to make sure everything in WordPress 6.6 is the best it can be.</p>\n\n\n\n<p>You can test WordPress 6.6 RC3 in four ways:</p>\n\n\n\n<figure class=\"wp-block-table\"><table><tbody><tr><th>Plugin</th><td>Install and activate the <a href=\"https://wordpress.org/plugins/wordpress-beta-tester/\">WordPress Beta Tester</a> plugin on a WordPress install. (Select the “Bleeding edge” channel and “Beta/RC Only” stream).</td></tr><tr><th>Direct Download</th><td>Download the <a href=\"https://wordpress.org/wordpress-6.6-RC3.zip\">RC3 version (zip)</a> and install it on a WordPress website.</td></tr><tr><th>Command Line</th><td>Use the this <a href=\"https://make.wordpress.org/cli/\">WP-CLI</a> command:<br><code>wp core update --version=6.6-RC3</code></td></tr><tr><th>WordPress Playground</th><td>Use the <a href=\"https://playground.wordpress.net/#%7B%20%22preferredVersions%22:%20%7B%20%22php%22:%20%228.0%22,%20%22wp%22:%20%22beta%22%20%7D,%20%22features%22:%20%7B%20%22networking%22:%20true%20%7D,%20%22steps%22:%20[%20%7B%20%22step%22:%20%22login%22,%20%22username%22:%20%22admin%22,%20%22password%22:%20%22password%22%20%7D,%20%7B%20%22step%22:%20%22importFile%22,%20%22file%22:%20%7B%20%22resource%22:%20%22url%22,%20%22url%22:%20%22https://raw.githubusercontent.com/wpaccessibility/a11y-theme-unit-test/master/a11y-theme-unit-test-data.xml%22%20%7D%20%7D,%20%7B%20%22step%22:%20%22importFile%22,%20%22file%22:%20%7B%20%22resource%22:%20%22url%22,%20%22url%22:%20%22https://raw.githubusercontent.com/WordPress/theme-test-data/master/themeunittestdata.wordpress.xml%22%20%7D%20%7D,%20%7B%20%22step%22:%20%22installPlugin%22,%20%22pluginZipFile%22:%20%7B%20%22resource%22:%20%22wordpress.org/plugins%22,%20%22slug%22:%20%22query-monitor%22%20%7D,%20%22options%22:%20%7B%20%22activate%22:%20false%20%7D,%20%22progress%22:%20%7B%20%22weight%22:%202%20%7D%20%7D,%20%7B%20%22step%22:%20%22installPlugin%22,%20%22pluginZipFile%22:%20%7B%20%22resource%22:%20%22wordpress.org/plugins%22,%20%22slug%22:%20%22create-block-theme%22%20%7D,%20%22progress%22:%20%7B%20%22weight%22:%202%20%7D%20%7D,%20%7B%20%22step%22:%20%22installPlugin%22,%20%22pluginZipFile%22:%20%7B%20%22resource%22:%20%22wordpress.org/plugins%22,%20%22slug%22:%20%22debug-bar%22%20%7D,%20%22progress%22:%20%7B%20%22weight%22:%202%20%7D%20%7D,%20%7B%20%22step%22:%20%22installPlugin%22,%20%22pluginZipFile%22:%20%7B%20%22resource%22:%20%22wordpress.org/plugins%22,%20%22slug%22:%20%22health-check%22%20%7D,%20%22progress%22:%20%7B%20%22weight%22:%202%20%7D%20%7D,%20%7B%20%22step%22:%20%22installPlugin%22,%20%22pluginZipFile%22:%20%7B%20%22resource%22:%20%22wordpress.org/plugins%22,%20%22slug%22:%20%22test-reports%22%20%7D,%20%22progress%22:%20%7B%20%22weight%22:%202%20%7D%20%7D,%20%7B%20%22step%22:%20%22installPlugin%22,%20%22pluginZipFile%22:%20%7B%20%22resource%22:%20%22wordpress.org/plugins%22,%20%22slug%22:%20%22user-switching%22%20%7D,%20%22progress%22:%20%7B%20%22weight%22:%202%20%7D%20%7D%20]%20%7D\">6.6 RC3 WordPress Playground instance</a> (available within 35 minutes after the release is ready) to test the software directly in your browser without the need for a separate site or setup.</td></tr></tbody></table><figcaption class=\"wp-element-caption\">Please test WordPress 6.6 RC3 in one or more of these four ways.</figcaption></figure>\n\n\n\n<p>The target for the WordPress 6.6 release is <strong>next Tuesday,</strong> <strong>July 16, 2024</strong>. Get an overview of the <a href=\"https://make.wordpress.org/core/6-6/\">6.6 release cycle</a>, and check the <a href=\"https://make.wordpress.org/core/\">Make WordPress Core blog</a> for <a href=\"https://make.wordpress.org/core/tag/6-6/\">6.6-related posts</a> in the next few weeks for further details.</p>\n\n\n\n<h2 class=\"wp-block-heading\">What&#8217;s in WordPress 6.6 RC3?</h2>\n\n\n\n<p>Thanks to your testing (and many other contributors‘ up to now) this release includes eight bug fixes for the Editor and  <a href=\"https://core.trac.wordpress.org/query?status=closed&amp;changetime=06%2F25%2F2024..07%2F01%2F2024&amp;milestone=6.6&amp;col=id&amp;col=milestone&amp;col=owner&amp;col=type&amp;col=priority&amp;order=id\">18 tickets for WordPress Core</a>.</p>\n\n\n\n<p>Get a recap of WordPress 6.6’s highlighted features in the <a href=\"https://wordpress.org/news/2024/06/wordpress-6-6-beta-1/\" data-type=\"post\" data-id=\"17289\">Beta 1 announcement</a>. For more technical information related to issues addressed since RC 2, you can browse the following links:</p>\n\n\n\n<ul class=\"wp-block-list\">\n<li><a href=\"https://github.com/WordPress/gutenberg/commits/wp/6.6?since=2024-07-02&amp;until=2024-07-09\">GitHub commits for 6.6</a> since July 2</li>\n\n\n\n<li><a href=\"https://core.trac.wordpress.org/query?status=closed&amp;changetime=06%2F25%2F2024..07%2F01%2F2024&amp;milestone=6.6&amp;col=id&amp;col=milestone&amp;col=owner&amp;col=type&amp;col=priority&amp;order=id\">Closed Trac </a><a href=\"https://core.trac.wordpress.org/query?status=closed&amp;changetime=07%2F02%2F2024..07%2F09%2F2024&amp;milestone=6.6&amp;col=id&amp;col=milestone&amp;col=owner&amp;col=type&amp;col=priority&amp;order=id\">tickets</a> since July 2</li>\n</ul>\n\n\n\n<p>Want to look deeper into the details and technical notes for this release? You might want to make your first stop <a href=\"https://make.wordpress.org/core/2024/06/25/wordpress-6-6-field-guide/\">The WordPress 6.6 Field Guide</a>. Then, check out this list:</p>\n\n\n\n<ul class=\"wp-block-list\">\n<li><a href=\"https://make.wordpress.org/core/2024/06/20/roster-of-design-tools-per-block-wordpress-6-6-edition/\">Roster of design tools per block (WordPress 6.6 edition)</a></li>\n\n\n\n<li><a href=\"https://make.wordpress.org/core/tag/dev-notes+6-6/\">All 6.6-related developer notes</a></li>\n</ul>\n\n\n\n<h2 class=\"wp-block-heading\">You can contribute. Here&#8217;s how</h2>\n\n\n\n<p>WordPress is the world’s most popular open source web platform, thanks to a passionate community of people who collaborate on its development in a wide variety of ways. You can help—whether or not you have any technical expertise.</p>\n\n\n\n<h3 class=\"wp-block-heading\">Get involved in testing</h3>\n\n\n\n<p>Testing for issues is critical to keeping WordPress speedy, stable, and secure. It’s also a vital way for anyone to contribute. <a href=\"https://make.wordpress.org/test/2024/06/03/help-test-wordpress-6-6/\" data-type=\"post\" data-id=\"17392\">This detailed guide</a> will walk you through testing features in WordPress 6.6. If you&#8217;re new to testing, follow <a href=\"https://make.wordpress.org/test/2024/06/03/help-test-wordpress-6-6/\" data-type=\"post\" data-id=\"17289\">this general testing guide</a> for more details on getting set up.</p>\n\n\n\n<p>If you encounter an issue, please report it to the <a href=\"https://wordpress.org/support/forum/alphabeta/\">Alpha/Beta area</a> of the support forums. If you are comfortable writing a reproducible bug report, you can also report it on <a href=\"https://core.trac.wordpress.org/newticket\">WordPress Trac</a>. Before you do either, you may want to check your issue against a list of <a href=\"https://core.trac.wordpress.org/tickets/major\">known bugs</a>.</p>\n\n\n\n<p>Curious about testing releases in general? Follow along with the <a href=\"https://make.wordpress.org/test/\">testing initiatives in Make Core</a> and join the <a href=\"https://wordpress.slack.com/messages/core-test/\">#core-test channel</a> on <a href=\"https://wordpress.slack.com/\">Making WordPress Slack</a>.</p>\n\n\n\n<h3 class=\"wp-block-heading\">Please update your WordPress product</h3>\n\n\n\n<p>If you build themes, plugins, blocks, or patterns, your efforts play an integral role in adding new functionality to WordPress and helping bring new people and ideas to the most vibrant (and massive!) open source community in the world.&nbsp;</p>\n\n\n\n<p>Thanks for continuing to test your products with the WordPress 6.6 betas and release candidates. With RC3, you’ll want to make sure everything is working smoothly, and if it&#8217;s a plugin, update the <em>“Tested up to”</em> version in its <a href=\"https://developer.wordpress.org/plugins/wordpress-org/how-your-readme-txt-works/\">readme file</a> to 6.6.</p>\n\n\n\n<p>If you find compatibility issues, please post detailed information to the <a href=\"https://wordpress.org/support/forum/alphabeta/\">support forum</a>.</p>\n\n\n\n<h3 class=\"wp-block-heading\">Help translate WordPress</h3>\n\n\n\n<p>Do you speak a language other than English? <bdo lang=\"es\" dir=\"ltr\">¿Español?</bdo> <bdo lang=\"fr\" dir=\"ltr\">Français?</bdo> <bdo lang=\"ru\" dir=\"ltr\">Русский</bdo>? <bdo lang=\"ja\" dir=\"ltr\">日本</bdo>語? <bdo lang=\"hin\" dir=\"ltr\">हिन्दी</bdo>? <bdo lang=\"bn\" dir=\"ltr\">বাংলা</bdo>? You can <a href=\"https://translate.wordpress.org/projects/wp/dev/\">help translate WordPress into more than 100 languages</a>.</p>\n\n\n\n<h2 class=\"wp-block-heading\">The RC3 haiku</h2>\n\n\n\n<p>One week to go. Then:<br>Open the paintbox! Try the tools!<br>Play a new jazz tune.</p>\n\n\n\n<p class=\"has-text-align-right\"><em>Props to  <a href=\'https://profiles.wordpress.org/meher/\' class=\'mention\'><span class=\'mentions-prefix\'>@</span>meher</a> and <a href=\'https://profiles.wordpress.org/audrasjb/\' class=\'mention\'><span class=\'mentions-prefix\'>@</span>audrasjb</a>. for peer review.</em></p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:30:\"com-wordpress:feed-additions:1\";a:1:{s:7:\"post-id\";a:1:{i:0;a:5:{s:4:\"data\";s:5:\"17497\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:4;a:6:{s:4:\"data\";s:61:\"\n		\n		\n		\n		\n		\n				\n		\n		\n\n					\n										\n					\n		\n		\n\n			\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:4:{s:0:\"\";a:7:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:42:\"WP Briefing: Episode 83: Learning Pathways\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:64:\"https://wordpress.org/news/2024/07/episode-83-learning-pathways/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Mon, 08 Jul 2024 12:00:00 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:2:{i:0;a:5:{s:4:\"data\";s:7:\"Podcast\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:1;a:5:{s:4:\"data\";s:11:\"wp-briefing\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:53:\"https://wordpress.org/news/?post_type=podcast&p=17489\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:421:\"Discover how Learning Pathways can guide you through your WordPress journey with clarity and purpose. In the latest episode of WordPress Briefing, host Josepha Haden Chomphosy welcomes special guest Wes Theron to discuss the newly introduced Learning Pathways. These curated lesson sets are tailored to various experience levels, roles, and use cases, ensuring a personalized learning experience for every WordPress user.\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:9:\"enclosure\";a:1:{i:0;a:5:{s:4:\"data\";s:0:\"\";s:7:\"attribs\";a:1:{s:0:\"\";a:3:{s:3:\"url\";s:51:\"https://wordpress.org/news/files/2024/07/WPB083.mp3\";s:6:\"length\";s:1:\"0\";s:4:\"type\";s:0:\"\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:14:\"Brett McSherry\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:35130:\"\n<p>Discover how Learning Pathways can guide you through your WordPress journey with clarity and purpose. In the latest episode of WordPress Briefing, host Josepha Haden Chomphosy welcomes special guest Wes Theron to discuss the newly introduced Learning Pathways. These curated lesson sets are tailored to various experience levels, roles, and use cases, ensuring a personalized learning experience for every WordPress user. </p>\n\n\n\n<h2 class=\"wp-block-heading\">Credits</h2>\n\n\n\n<p>Host:&nbsp;<a href=\"https://profiles.wordpress.org/chanthaboune/\">Josepha Haden Chomphosy</a><br>Guest: <a href=\"https://profiles.wordpress.org/west7/\">Wes Theron</a><br>Editor:&nbsp;<a href=\"https://profiles.wordpress.org/dustinhartzler/\">Dustin Hartzler</a><br>Logo:&nbsp;<a href=\"https://profiles.wordpress.org/javiarce/\">Javier Arce</a><br>Production:&nbsp;<a href=\"https://profiles.wordpress.org/bjmcsherry/\">Brett McSherry</a><br>Song: Fearless First by Kevin MacLeod</p>\n\n\n\n<h2 class=\"wp-block-heading\">Show Notes</h2>\n\n\n\n<ul class=\"wp-block-list\">\n<li><a href=\"https://learn.wordpress.org/\">Learn.WordPress.org</a>\n<ul class=\"wp-block-list\">\n<li><a href=\"https://learn.wordpress.org/course/beginner-wordpress-developer/\">Beginner WordPress Developer</a></li>\n\n\n\n<li><a href=\"https://learn.wordpress.org/course/beginner-wordpress-user/\">Beginner WordPress User</a></li>\n</ul>\n</li>\n\n\n\n<li><a href=\"https://wordpress.org/playground/\">WordPress Playground</a></li>\n\n\n\n<li><a href=\"https://www.youtube.com/playlist?list=PL1pJFUVKQ7ETacCXdCCxwdAo-_xciwlQJ\">Learn WordPress YouTube Playlist</a></li>\n\n\n\n<li><strong>Small List of Big Things</strong>\n<ul class=\"wp-block-list\">\n<li><a href=\"https://wordpress.org/news/2024/06/wordpress-6-5-5/\">WordPress 6.5.5 is now available!</a></li>\n\n\n\n<li><a href=\"https://make.wordpress.org/community/2024/06/15/wordpress-contributor-mentorship-program-q4-2024-call-for-interest/\">WordPress Contributor Mentorship Program Q4 2024</a></li>\n\n\n\n<li><a href=\"https://make.wordpress.org/core/6-6/\" target=\"_blank\" rel=\"noreferrer noopener\">WordPress 6.6 Official Release</a>\n<ul class=\"wp-block-list\">\n<li><a href=\"https://www.youtube.com/watch?v=OyYdkXAx7qw\">What’s new for theme developers in WordPress 6.6</a></li>\n</ul>\n</li>\n\n\n\n<li><a href=\"https://make.wordpress.org/meetings/\">Upcoming WordPress Meetings</a></li>\n</ul>\n</li>\n\n\n\n<li>Have a question you’d like answered? Submit them to&nbsp;<a href=\"mailto:wpbriefing@WordPress.org\">WPBriefing@WordPress.org</a>.</li>\n</ul>\n\n\n\n<h2 class=\"wp-block-heading\">Transcript</h2>\n\n\n\n<span id=\"more-17489\"></span>\n\n\n\n<p>[00:00:00]&nbsp;<strong>Josepha:</strong>&nbsp;Hello, everyone, and welcome to the WordPress Briefing, the podcast where you can catch quick explanations of the ideas behind the WordPress open source project, some insight into the community that supports it, and get a small list of big things coming up in the next two weeks. I’m your host, Josepha Haden Chomphosy. Here we go.</p>\n\n\n\n<p>[00:00:28] (Intro music)&nbsp;</p>\n\n\n\n<p>[00:00:39] <strong>Josepha:</strong> As a steward of the WordPress community, one of the big overarching questions that I grapple with is how to make sure people who have just found out about us know how to get around. Obviously, there&#8217;s the contributor path, which is important to me because I am especially concerned with the longevity of our little open source community, but there&#8217;s also a path for folks who are learning how to use the software.</p>\n\n\n\n<p>[00:01:03] <strong>Josepha:</strong> And so, joining me today to talk through a project called Learning Pathways is Wes Theron. Wes, welcome to the WordPress Briefing.</p>\n\n\n\n<p>[00:01:11] <strong>Wes:</strong> Good day. Thank you very much for having me. It&#8217;s a pleasure.</p>\n\n\n\n<p>[00:01:13] <strong>Josepha:</strong> Before we get into this project that we&#8217;re talking about, do you want to just tell me a little bit about who you are and what you do with the WordPress project?</p>\n\n\n\n<p>[00:01:22] <strong>Wes:</strong> Yeah. So, as you know, my name is Wes Theron. I&#8217;m based in New Zealand, and I&#8217;m an instructional designer. And, I am part of the Training Team. So, most of my life revolves around creating learning content for learn.WordPress.org.</p>\n\n\n\n<p>[00:01:38] <strong>Josepha:</strong> Oh, that&#8217;s quite a life. Teaching people how to use WordPress.</p>\n\n\n\n<p>[00:01:42] <strong>Wes:</strong> Yeah, I teach WordPress. We run online workshops. I create video tutorials, courses, and now, of course, this great project we&#8217;re working on, Learning Pathways.</p>\n\n\n\n<p>[00:01:52] <strong>Josepha:</strong> Yeah. So, I&#8217;ve talked about Learning Pathways a few times here on the podcast, but for folks who have not heard me talk about it or who just need a more in-depth understanding, why don&#8217;t you tell us a little bit about this project as it stands today?&nbsp;</p>\n\n\n\n<p>[00:02:06] <strong>Wes:</strong> Yeah, so when Learn started out, I think the main goal was to just get learning content on the site. But, in May of last year, we shared an individual learning survey with folks, and we were hoping to basically find out what are the needs of the learners? What are learners after? And from that individual learner survey, we actually learned a few things. We learned that tutorials, courses, and online workshops were the most used content types. We also saw that web-based learning is the most popular learning method. And then there was a clear need for a structured way of consuming learning material. And that&#8217;s basically where the Learning Pathways project was born; to create Learning Pathways that basically target various types of learners, but also various skill levels. So July of last year, we started with outlines, creating outlines for these learner pathways.</p>\n\n\n\n<p>[00:03:10] <strong>Wes:</strong> And then, in October of last year, we actually started creating content. So, the first learner pathways we started working on was the User Learning Pathway and the Developer Learning Pathway. And what that entails is of course, creating a Learning Pathway for beginner users, intermediate users, and then advanced users.</p>\n\n\n\n<p>So that&#8217;s how we kind of broke it up. And last week, the Beginner Developer Pathway was actually published, so that&#8217;s very exciting. And a few weeks before that, the Beginner WordPress User Pathway. And yeah, of course, we&#8217;ve got many other pathways in the pipeline that we want to work on. For example, a Designer Learning Pathway and even a Contributor Learning Pathway.</p>\n\n\n\n<p>[00:03:57] <strong>Josepha:</strong> Yeah, when we&#8217;re talking about pathways, what we mean is, like, we are figuring out what you probably need to know when you first arrive and then helping you to identify what you build on based on what your goals might be.</p>\n\n\n\n<p>[00:04:11] <strong>Josepha:</strong> Like, obviously, the beginner user, the goal is basically just like, learn how to get WordPress doing stuff at all. Like that&#8217;s, that&#8217;s an easy goal to understand. But when you all were doing the work to figure out what needed to be in the pathway for a beginner developer, and as you&#8217;re looking towards doing the work around intermediate and advanced topics, like how are you all able to determine what most likely you need in those various steps in the learning process?</p>\n\n\n\n<p>[00:04:42] <strong>Wes:</strong> So, of course, a lot of research went into that. When we created the outlines for these Learning Pathways. We shared it with the community. We asked for feedback. And yeah, a lot of research was done to make sure we cover all the all the bases. </p>\n\n\n\n<p>[00:04:59] <strong>Josepha:</strong> I know that there were a couple of different proposals about how to, like do skills assessments, maybe? There was something where like we were talking with companies that employ WordPress folks in the ecosystem, and then we were talking to WordPressers who were currently trying to make sure that their skills were advanced enough to get those jobs. And we were trying to figure out like the distance between those and where we actually have some concerns around like the language choices that they need, like basic developer language choices and jargon that goes in there and stuff like that.</p>\n\n\n\n<p>[00:05:34] <strong>Josepha:</strong> So this, if I recall correctly, the research for this has been going on for like maybe two or three years, right?</p>\n\n\n\n<p>[00:05:42] <strong>Wes:</strong> Yeah, definitely. And we&#8217;ve reached out to many stakeholders within the WordPress community. And as you say, even agencies, and businesses, you know, trying to find out what do they want people to know when they employ them. And yeah, then of course, speaking to the community, speaking, speaking to folks at WordCamps reaching out to folks an online workshops.</p>\n\n\n\n<p>[00:06:04] <strong>Wes:</strong> So, yeah, it&#8217;s definitely been an ongoing process and also seeing what resources are lacking and what needs to be there.&nbsp;</p>\n\n\n\n<p>[00:06:12] <strong>Josepha:</strong> Yeah, so, the very first, the very first iteration of any training that the WordPress project was offering on, I think it was on learn.WordPress.org, but I don&#8217;t actually know for sure, was a troubleshooting workshop, because when you are trying to figure out WordPress for the first time, when you are trying to figure out any software for the first time, being able to figure out what went wrong is a really important part of that. And so that was like the only workshop that existed over there for quite some time. And so it&#8217;s really nice to see how we have really, not only created a bunch of resources in general, if you all have not looked at learn.WordPress.org lately, it has, like, workshop outlines that you can use to do a training by yourself at your meetup group or at a school or whatever it is.</p>\n\n\n\n<p>[00:07:08] <strong>Josepha:</strong> But then also, I want to say it was maybe two, three years ago, that you all, as a team, the Training Team, started doing these online workshops. And so, when you created the Learning Pathways, considering like how much time and research has gone into this project overall, did you all have learnings that came from those workshops that you had already done? Is this like a collection of workshops or is this something where you can do it at home and learn by yourself and then go someplace else and learn more about WordPress? Like how does that function in what we have already?</p>\n\n\n\n<p>[00:07:45] <strong>Wes:</strong> Yeah, so maybe I should first, maybe let&#8217;s define a learning pathway. So I, I thought about this, but a learning pathway, I would say, is a route taken by learner through a range of modules, lessons, and even courses to build knowledge progressively. So it&#8217;s similar to a course, but of course usually covers like a specific topic or subject where learning pathways usually have a larger goal.</p>\n\n\n\n<p>[00:08:11] <strong>Wes:</strong> So I wouldn&#8217;t say that the online workshops form part of the Learning Pathways project. And maybe I can also clarify that the teacher notes or the lesson plans that you refer to is something that&#8217;s also changing going forward. </p>\n\n\n\n<p>[00:08:23] <strong>Josepha:</strong> Oh, good. Because I wrote some of those, and I am not an instructional designer. And so, ha!</p>\n\n\n\n<p>[00:08:30] <strong>Wes:</strong> We&#8217;ve actually decided to move away from having two different content types. So, we had tutorials. You know, video tutorials, and we had lesson plans, and as you said, the lesson plans were notes that somebody could use to run an online workshop or to go to a WordCamp or at their local meetup and use that to teach something. But moving forward for Learning Pathways, we are actually just going to have one content type, namely lessons. And then lessons from part of creating a course or lessons from part of creating modules and then Learning Pathways. The other exciting thing, and something we haven&#8217;t mentioned, is that at the end of this month, when we launched the Learning Pathways or the first few Learning Pathways, it actually coincides with a website redesign.</p>\n\n\n\n<p>[00:09:18] <strong>Wes:</strong> So, yeah, beyond the lookout, hopefully, learn.WordPress.org is going to have a brand new face at the end, from the end of July or, yeah, or August. So, yeah, that&#8217;s very exciting.</p>\n\n\n\n<p>[00:09:30] <strong>Josepha:</strong> Excellent. Excellent. So, you said that these Learning Pathways are part of a larger goal. Is that a goal for your learners or a goal for WordPress? A goal for the team?</p>\n\n\n\n<p>[00:09:40] <strong>Wes:</strong> I would say all of the above.</p>\n\n\n\n<p>[00:09:42] <strong>Josepha:</strong> Goals for everybody. We&#8217;re like the Oprah of goals. Don&#8217;t come get me, Oprah. That&#8217;s all I got to say about it.</p>\n\n\n\n<p>[00:09:48] <strong>Wes:</strong> Yeah, I think for us as a team, at the end of the day, we want folks to be able to use the content and find the content and utilize all the learning material on learn.WordPress.org. And then, of course, at the end of the day, for learners, we want folks to be able to succeed in whatever they are trying to do. Is it to build their own website? Is it to maybe find a job as a developer? And. Yeah, I mean, the list can go on.</p>\n\n\n\n<p>[00:10:21] <strong>Josepha:</strong> Yeah. So, on the subject of wanting to help people succeed, I think that as far as I hear from the majority of contributors that I have worked with over the years, like helping other people figure out how to do this and making sure that they can succeed is always something that is top of mind for contributors to open source probably in general, but definitely to WordPress. Like, we really care about helping other people figure out how to have the same sort of benefits that we&#8217;ve had in the project and with the software. So if you have somebody who is familiar with all the bits and pieces of WordPress and really, really want to like show up and help teach some things. Is it the case that they can take part in like running a Learning Pathway? Is it something where we mostly need people to help us build some content? Like if we&#8217;ve got people who are just desperate to help other people succeed in WordPress, what kinds of things can they show up and help do on this project?</p>\n\n\n\n<p>[00:11:22] <strong>Wes:</strong> Yes, please come to the Training Team. There are many ways to get involved. If you just want to review content, you can do that. But yeah, we do have a need for content creators, folks, you know, creating a video lesson or putting their hand up and saying, I will actually create an entire module or an entire learning, a Learning Pathway. We do have some awesome contributors that&#8217;s part of the Training Team that are already doing that. Some people are writing scripts. Some folks are actually, you know, creating everything from the beginning to the end. So they are writing the script, they recording the video, publishing the video, et cetera. And then we&#8217;ve, of course, have people reviewing content. We&#8217;ve got folks running online workshops. If maybe creating video content is not their, is not their forte, they can can run online workshops. So yeah, many ways getting involved.</p>\n\n\n\n<p>[00:12:16] <strong>Wes:</strong> But Josepha, I wanted to point something else out that I haven&#8217;t done. I think there was a real need for Learning Pathways because, at the moment, if somebody new to WordPress or new to developing with WordPress wants to find learning content. You know, where do they go? What&#8217;s the main platform to go to? I think most people probably go to YouTube, right?&nbsp;But a lot of the content there are, are scattered and fragmented. </p>\n\n\n\n<p>So a lot of learning material or learning about WordPress is all over the place. It&#8217;s not in one place. And as I said, a place where you can actually learn from A to Z, learn progressively learning in a structured way. Yes, we know there are courses available that you can pay for, but the awesome thing about this project is that we are providing these Learning Pathways, these learning resources, for free for folks to be able to work through at their own time. I know that&#8217;s something else you asked earlier on. So yes, this is a course in quotation marks; this is a Learning Pathway that somebody can start whenever it suits them, you know, in the comfort of their own home, and they can work through the Learning Pathway from the beginning to the end. Or, if they feel I actually know everything taught in module one and two, I&#8217;m going to start at module three, they can do that. They basically come in at their skill level.</p>\n\n\n\n<p>[00:13:43] <strong>Josepha:</strong> Yes. I think it&#8217;s really important to try to meet people where they are. And I know that it&#8217;s difficult because, like, we don&#8217;t take a lot of data from our users. You don&#8217;t have to give us basically anything in order to use WordPress. And by basically, I mean you literally don&#8217;t have to give us anything to use WordPress.</p>\n\n\n\n<p>[00:14:01] <strong>Josepha:</strong> And so we always have some difficulty in figuring out what is it that our users need the most in order to succeed the quickest. And so I agree that there was a real need for this not only because, like, there&#8217;s plenty of content for getting from, like, some knowledge to a good amount of knowledge. There&#8217;s almost no content around, like, I didn&#8217;t know CMSs existed until yesterday, and now I need to quickly learn how to do it because it&#8217;s become a thing I need to do in my job. There&#8217;s some really clear, like use cases for being able to onboard quickly and progressively.<br><br>And I understand that, like, having a clear, structured way to learn doesn&#8217;t always fit with the idea of meeting people where they are. But I do really think that, that like what you were saying, it can be as structured as you need it to be. But also, if you get into it and you think to yourself, you know, I know this information already. I can move on to the next module. I can move on to the module after that. Similar to the way we do that at WordCamps also. If you get into a session and you thought it was going to be useful for you, and you discover that it&#8217;s not once you&#8217;re there, you don&#8217;t have to stay. You can go to a different room where they&#8217;re teaching about SEO if it turns out that you don&#8217;t need to learn about JavaScript today.</p>\n\n\n\n<p>[00:15:23] <strong>Josepha:</strong> And I think that that&#8217;s, it&#8217;s kind of the value that this is hoping to bring, like, because it is a little bit built one on top of the other when you discover that you have already learned something, you can easily try out the next step and know that it&#8217;s probably a good next step.</p>\n\n\n\n<p>[00:15:38] <strong>Wes:</strong> Exactly. And if you maybe want to teach this to other folks. The plan is to, you know, we had lesson plans. We have a lot of lesson plans on Learn. But the plan is also to, instead of having, as I said, two different content types, is to have lessons but then add a tab where you can click on teacher notes and actually teach something as well if that is your goal. But yes, our lessons and modules also include quizzes and, hopefully, some practical activities. We&#8217;ve incorporated WordPress Playground where, where folks can actually, you know, test out what they&#8217;ve learned or test their knowledge. So yeah, I agree with you that you can basically join the Learning Pathway wherever you feel the most comfortable.</p>\n\n\n\n<p>[00:16:28] <strong>Josepha:</strong> So we&#8217;ve been kind of in the weeds of the project itself, the program itself, and if you want to like do stuff with that and in that. Let&#8217;s switch gears a little bit and talk about just what people who are wanting to join those pathways would need to know. Do you have any advice for somebody who is just today learning about these Learning Pathways and they think to themselves, I definitely want to sign up for one of those. Like, for one, how do they get started? And for two, your like top two or three bits of advice for as they get started? </p>\n\n\n\n<p>[00:17:05] <strong>Wes:</strong> So you can make your way to learn.WordPress.org, and you can basically open the, the pathway, and you can start wherever, wherever you want to. We have made it possible to actually view these pathways or our content without logging in with your dot org profile. The other thing I also wanted to mention is that our content is actually hosted on YouTube now.</p>\n\n\n\n<p>So the great thing is we have these pathways within YouTube as well. So, folks can go to the, YouTube channel and see our content. And, of course, that basically reaches a very wide audience. And hopefully some of those videos will also bring people to the dot org site so that they can access the content.</p>\n\n\n\n<p>[00:17:57] <strong>Josepha:</strong> I think it&#8217;s great that you don&#8217;t have to sign up for a profile. If you are a brand new WordPresser and ran into this in your dashboard and are listening to this podcast now. So dot org profiles are a place where you can kind of log your activity in the WordPress community and the WordPress project. You do not have to have one in order to use WordPress. You don&#8217;t have to have one in order to look at these courses or to learn from them. But I always think that it&#8217;s kind of nice to get your profile set up so that people kind of know who you are and what you&#8217;re doing. And then also your activity shows up. Like, you can see that you enrolled in the course and you get to know for yourself that you made some progress. I know that when you&#8217;re getting started, it&#8217;s hard to, like, see your progress because you don&#8217;t know how far you have to go. And so, like progress when you&#8217;re starting out is really difficult to feel is real. And so I like it just so that you have a few reminders to yourself, like, look how far I&#8217;ve come as you&#8217;re trying to figure out how far you still have to go. And so I like that a lot. </p>\n\n\n\n<p>[00:18:58] <strong>Wes:</strong> You won&#8217;t be able to access all the content on Learn without your dot org profile. But one of the things we&#8217;ve made possible is to access these Learning Pathways, the new ones being launched without, you know, removing those blockers. So, of course, when you work through a Learning Pathway, you will be able to track your progress, and you will be able to see which lessons you have completed. So yeah, one of the pieces of advice I would give to somebody starting with the Learning Pathways actually to first go through the modules. And go through the lessons to see which things you know and feel comfortable with so that you don&#8217;t waste time maybe going through the first module and say, oh, I know this, and you&#8217;ve wasted time. Rather do a bit of research, a bit of reading, and then find the right place for you to start the journey.</p>\n\n\n\n<p>[00:19:45] <strong>Josepha:</strong> That&#8217;s excellent. I also, just as a learner, I try to always learn some stuff. And also, as you get older, it&#8217;s harder and harder to learn things partially because like you&#8217;re in a set path, but also, and here&#8217;s my advice to new learners: you worry about looking foolish. Like you, you worry, you&#8217;re showing up, and you don&#8217;t know anything about anybody else in the classroom. And so there&#8217;s this feeling of like, what if I&#8217;m the only person who does not know how to make this work? What if I&#8217;m the only person who can&#8217;t figure out what Wes meant by &#8220;Playground&#8221; or whatever it is? There&#8217;s this real feeling of looking silly when you&#8217;re doing something like this.</p>\n\n\n\n<p>[00:20:25] <strong>Josepha:</strong> I can&#8217;t control what anybody else says or does to anyone else, unfortunately. But what I can say is that I think that there&#8217;s never a bad time to start something you wish you had done, right? Like, the best time to have learned how to use your CMS, your website, make your website work was probably a year ago or something, but the second best time is today. And so, like, why not go ahead and get started and be part of that small group of adults that are learning new things every single day? I think that&#8217;s great. And so that&#8217;s my tip is to just embrace looking silly sometimes because you&#8217;re making some choices about your future, and that&#8217;s always a good choice.</p>\n\n\n\n<p>[00:21:04] <strong>Wes:</strong> And I would also say test your knowledge. So you&#8217;ve mentioned WordPress Playground. And as I said, we&#8217;ve incorporated into the Learning Pathways, but sometimes you watch a video, or you read something, and you feel like, oh yeah, I know this, but you know, the proof is in the pudding. So go and test it out. Use a test website or use WordPress Playground and test yourself to see if you can actually implement this or do something. So yeah, that&#8217;s definitely one of the other tips I want to highlight; you know, they also say you, you learn by doing.</p>\n\n\n\n<p>[00:21:38] <strong>Josepha:</strong> Yeah, absolutely. And also, like if you have gotten to a point you&#8217;ve done the learning, you&#8217;ve done some practicing, you think you&#8217;ve got it and want to like try to figure out what other things can be done with it. I recommend this is how I did a lot of my early WordPress learning to organize an event with your local meetup.<br><br>Like, I did not know enough about WordPress when I started organizing WordPress meetups. I literally knew nothing. And I basically brought people in and was like, hey, we need people to teach us about this, us being half me. Come in and teach us. And, and that can be a really good thing, partially because, like, you get to know your local folks and see what&#8217;s going on and get a sense for, like, what is out there, especially if you&#8217;re learning this in order to run a business or to accomplish something for your job that you already have, like knowing what&#8217;s out there is super helpful. But then I find that once you embrace the fact that sometimes you will look silly, and that&#8217;s the only way that we can know we&#8217;re learning something. Like once you&#8217;ve embraced it, having some people who are willing to look a little silly with you is kind of, kind of fun, kind of nice. Also, like we&#8217;re all going to look at this problem that we definitely don&#8217;t understand and hopefully look like, at the end, we know what we&#8217;re doing, but between looking at it the first time and at the end of this meetup, we&#8217;re all going to look a little bit silly, ask silly questions. And I think that that&#8217;s a really helpful thing, too. But yeah, knowing some basic information is a great place to start before you do that, especially if you get anxious about looking silly. And I think these pathways are going to really help to get folks a little bit of a leg up on those big questions that they have as you&#8217;re starting to learn how to use WordPress.</p>\n\n\n\n<p>[00:23:18] <strong>Josepha:</strong> So we talked about, like, tips and tricks for learners in general. But if you had something that you wanted to share with us that, like, you&#8217;re really excited about for either the Training Team or for the Learning Pathways in general, I think the Learning Pathways are slated to be shipped by, like, end of September or something. So, like, a lot of them are coming quite quickly.&nbsp;</p>\n\n\n\n<p>[00:23:38] <strong>Wes:</strong> So I am most excited about the website redesign and the new look and feel of the website. And also, you know, one of the goals for us as a Training Team is for learn.WordPress.org to be one of the places people come to and learn about WordPress. And I feel these Learning Pathways and the new website redesign and all the hard work that&#8217;s gone into this project is hopefully going to, make that happen. As I said, our content is also available on YouTube. So we&#8217;ve really tried to make it easy for folks to find our content and also now to digest our content in a progressive and in a structured way. Because, you know, learning is hard. And hopefully, these Learning Pathways have made it easier for folks to, as you said, to build on your knowledge. You know, a lot of times, there&#8217;s knowledge gaps. And I think that&#8217;s what makes learning so hard. And hopefully with these pathways, you can build that knowledge one step at a time.</p>\n\n\n\n<p>[00:24:44] <strong>Josepha:</strong> Yeah. And as is the way with open source, like we can only make these pieces of content better if you all show up and help us like try it out, learn some stuff, and tell us what was confusing. Tell us what was too big a step. Cause yeah, you&#8217;re right. There are some knowledge gaps and when you&#8217;re on the other side of knowing something, it is so hard to tell how big a step is, you know?</p>\n\n\n\n<p>[00:25:11] <strong>Wes:</strong> Exactly.</p>\n\n\n\n<p>[00:25:12] <strong>Josepha:</strong> And so we need y&#8217;all to come in here and tell us very plainly as a new learner like that was eventually what I needed, but this part here was especially confusing. This part over here was too like too many little steps like we just we&#8217;re trying to make sure that it works for you WordPressers, future WordPressers of the world. And so yeah, come build some learning with us over here on the Training Team.</p>\n\n\n\n<p>[00:25:35] <strong>Wes:</strong> And yes, please, we want feedback because, as you say, as we iterate, we want to improve. So there will be a place where you can provide feedback, and at the end of the pathway where there will also be a satisfaction survey for folks to to complete.</p>\n\n\n\n<p>[00:25:50] <strong>Josepha:</strong> Great. Well, folks, we&#8217;re gonna have a bunch of links in the show notes. There&#8217;s so much stuff out here to learn with and about WordPress. Wes, thank you so much for joining me today.</p>\n\n\n\n<p>[00:26:01] <strong>Wes:</strong> Thank you for having me. And I will see you all on Learn.</p>\n\n\n\n<p>[00:26:05] (Music interlude)</p>\n\n\n\n<p>[00:26:12] <strong>Josepha:</strong> That brings us now to our small list of big things. Although I have to say we have a bunch of links that we&#8217;re going to share in the show notes. If you&#8217;re listening to this in a place where there are not show notes, you can head over to WordPress.org/news. That&#8217;s where we keep all of those. If you are lucky, we also will help you find it on Twitter/X, but I think that it&#8217;s hard to find things over there these days. So WordPress.org/news is your best bet. Now, it is time for the small list of big things.</p>\n\n\n\n<p>So, first up on my list is that WordPress 6.5.5 is now available. It&#8217;s got a few fixes in it, some maintenance things and some security fixes as well. I recommend that you update your sites immediately. You can download it from WordPress.org/download, or you can just visit your WordPress dashboard. If you&#8217;re on a managed host, they may have already done this for you, too. But auto-updates, manual updates, CLI updates. However, you want to get it done, get it done. But it is recommended to do this as soon as possible. 6.5.5.&nbsp;</p>\n\n\n\n<p>[00:27:16] <strong>Josepha:</strong> The second thing on my list is that the WordPress Contributor Mentorship program has a call for interest out. This is a program that we launched about a year ago as well. And we had such a good bit of success at the end of the first round in February that there was significant interest in doing another cohort. So, that program connects seasoned WordPress contribution experts with folks who are new to contributing and offer a fantastic opportunity for mentees to gain hands-on experience contributing to WordPress while their mentors share their expertise and improve their leadership skills. So, most of the time, what you are going to be contributing to is probably a release of WordPress, but there are also a lot of opportunities to contribute to things like the Training Team that we&#8217;ve been talking about today and other teams as well. Not everything is focused all around our release cycle. We have things happening in the WordPress project literally all the time. It is a project that never sleeps.&nbsp;</p>\n\n\n\n<p>[00:28:17] <strong>Josepha:</strong> Speaking of projects that never sleep, our next official release, our second release of the year, is coming out. WordPress 6.6 is coming out just about a week from now. It is the second major release of 2024 and has a lot of things in it that you will want to check out. If you have not yet seen the hallway hangout where we take a look at what was happening in the release, what we intended to get into the release, take a look at it. And if you haven&#8217;t tested it yet, if you are one of our plugin developers, if you are building something on top of WordPress core, now is the time to check that out and test it against your products.</p>\n\n\n\n<p>And then the final thing is that it&#8217;s a new month, my friends. Here we are in July, and we have a ton of things happening in the project. That&#8217;s the theme of my small list of big things: the project that never sleeps. But we have a lot of team meetings that are happening. If you haven&#8217;t attended one in a while or even if you have never attended one of these meetings and you were trying to figure out when to start, now is as good a time as any. You can join your fellow community members and contribute to the WordPress project. And there are ways that you can do that from home and from your computer and for some parts of the project, like from your phone, if you are taking photos out and about and submitting those. So check out make.WordPress.org/meetings. It&#8217;ll give you a sense for everything that&#8217;s happening. Do not get overwhelmed by that calendar. You can just choose which team you think is most interesting to you. </p>\n\n\n\n<p>[00:29:45] <strong>Josepha:</strong> And that, my friends, is your small list of big things. Your small list of never-sleeping things. Don&#8217;t forget to follow us on your favorite podcast app or subscribe directly on WordPress.org/news. You&#8217;ll get a friendly reminder whenever there&#8217;s a new episode. If you liked what you heard today, share it with a fellow WordPresser. Or, if you had questions about what you heard, you can share those with me at WPBriefing@WordPress.org. I&#8217;m your host, Josepha Haden Chomphosy. Thanks for tuning in today for the WordPress Briefing, and I&#8217;ll see you again in a couple of weeks.&nbsp;</p>\n\n\n\n<p>[00:30:15] (Music outro)</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:30:\"com-wordpress:feed-additions:1\";a:1:{s:7:\"post-id\";a:1:{i:0;a:5:{s:4:\"data\";s:5:\"17489\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:5;a:6:{s:4:\"data\";s:69:\"\n		\n		\n		\n		\n		\n				\n		\n		\n		\n		\n		\n\n					\n										\n					\n		\n		\n			\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:4:{s:0:\"\";a:6:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:33:\"WordPress 6.6 Release Candidate 2\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:69:\"https://wordpress.org/news/2024/07/wordpress-6-6-release-candidate-2/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 02 Jul 2024 17:09:27 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:5:{i:0;a:5:{s:4:\"data\";s:11:\"Development\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:1;a:5:{s:4:\"data\";s:8:\"Releases\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:2;a:5:{s:4:\"data\";s:3:\"6.6\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:3;a:5:{s:4:\"data\";s:11:\"development\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:4;a:5:{s:4:\"data\";s:8:\"releases\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:35:\"https://wordpress.org/news/?p=17469\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:345:\"WordPress 6.6 RC2 is ready for download and testing! This version of the WordPress software is under development. Please do not install, run, or test this version of WordPress on production or mission-critical websites. Instead, please evaluate RC2 on a test server or a local environment. Reaching this phase of the release cycle is a [&#8230;]\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:8:\"marybaum\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:10955:\"\n<p>WordPress 6.6 RC2 is ready for download and testing!</p>\n\n\n\n<p><strong>This version of the WordPress software is under development</strong>.<strong> Please do not install, run, or test this version of WordPress on production or mission-critical websites.</strong> Instead, please evaluate RC2 on a test server or a local environment.</p>\n\n\n\n<p>Reaching this phase of the release cycle is a worthy achievement. While release candidates are considered ready for release, your testing is still vital to make sure everything in WordPress 6.6 is the best it can be.</p>\n\n\n\n<p>You can test WordPress 6.6 RC2 in four ways:</p>\n\n\n\n<figure class=\"wp-block-table\"><table><tbody><tr><th>Plugin</th><td>Install and activate the <a href=\"https://wordpress.org/plugins/wordpress-beta-tester/\">WordPress Beta Tester</a> plugin on a WordPress install. (Select the “Bleeding edge” channel and “Beta/RC Only” stream).</td></tr><tr><th>Direct Download</th><td>Download the <a href=\"https://wordpress.org/wordpress-6.6-RC2.zip\">RC2 version (zip)</a> and install it on a WordPress website.</td></tr><tr><th>Command Line</th><td>Use the this <a href=\"https://make.wordpress.org/cli/\">WP-CLI</a> command:<br><code>wp core update --version=6.6-RC2</code></td></tr><tr><th>WordPress Playground</th><td>Use the <a href=\"https://playground.wordpress.net/#%7B%20%22preferredVersions%22:%20%7B%20%22php%22:%20%228.0%22,%20%22wp%22:%20%22beta%22%20%7D,%20%22features%22:%20%7B%20%22networking%22:%20true%20%7D,%20%22steps%22:%20[%20%7B%20%22step%22:%20%22login%22,%20%22username%22:%20%22admin%22,%20%22password%22:%20%22password%22%20%7D,%20%7B%20%22step%22:%20%22importFile%22,%20%22file%22:%20%7B%20%22resource%22:%20%22url%22,%20%22url%22:%20%22https://raw.githubusercontent.com/wpaccessibility/a11y-theme-unit-test/master/a11y-theme-unit-test-data.xml%22%20%7D%20%7D,%20%7B%20%22step%22:%20%22importFile%22,%20%22file%22:%20%7B%20%22resource%22:%20%22url%22,%20%22url%22:%20%22https://raw.githubusercontent.com/WordPress/theme-test-data/master/themeunittestdata.wordpress.xml%22%20%7D%20%7D,%20%7B%20%22step%22:%20%22installPlugin%22,%20%22pluginZipFile%22:%20%7B%20%22resource%22:%20%22wordpress.org/plugins%22,%20%22slug%22:%20%22query-monitor%22%20%7D,%20%22options%22:%20%7B%20%22activate%22:%20false%20%7D,%20%22progress%22:%20%7B%20%22weight%22:%202%20%7D%20%7D,%20%7B%20%22step%22:%20%22installPlugin%22,%20%22pluginZipFile%22:%20%7B%20%22resource%22:%20%22wordpress.org/plugins%22,%20%22slug%22:%20%22create-block-theme%22%20%7D,%20%22progress%22:%20%7B%20%22weight%22:%202%20%7D%20%7D,%20%7B%20%22step%22:%20%22installPlugin%22,%20%22pluginZipFile%22:%20%7B%20%22resource%22:%20%22wordpress.org/plugins%22,%20%22slug%22:%20%22debug-bar%22%20%7D,%20%22progress%22:%20%7B%20%22weight%22:%202%20%7D%20%7D,%20%7B%20%22step%22:%20%22installPlugin%22,%20%22pluginZipFile%22:%20%7B%20%22resource%22:%20%22wordpress.org/plugins%22,%20%22slug%22:%20%22health-check%22%20%7D,%20%22progress%22:%20%7B%20%22weight%22:%202%20%7D%20%7D,%20%7B%20%22step%22:%20%22installPlugin%22,%20%22pluginZipFile%22:%20%7B%20%22resource%22:%20%22wordpress.org/plugins%22,%20%22slug%22:%20%22test-reports%22%20%7D,%20%22progress%22:%20%7B%20%22weight%22:%202%20%7D%20%7D,%20%7B%20%22step%22:%20%22installPlugin%22,%20%22pluginZipFile%22:%20%7B%20%22resource%22:%20%22wordpress.org/plugins%22,%20%22slug%22:%20%22user-switching%22%20%7D,%20%22progress%22:%20%7B%20%22weight%22:%202%20%7D%20%7D%20]%20%7D\">6.6 RC2 WordPress Playground instance</a> (available within 35 minutes after the release is ready) to test the software directly in your browser without the need for a separate site or setup.</td></tr></tbody></table><figcaption class=\"wp-element-caption\">Please test WordPress 6.6 RC2 in one or more of these four ways.</figcaption></figure>\n\n\n\n<p>The target for the WordPress 6.6 release is <strong>July 16, 2024</strong>. Get an overview of the <a href=\"https://make.wordpress.org/core/6-6/\">6.6 release cycle</a>, and check the <a href=\"https://make.wordpress.org/core/\">Make WordPress Core blog</a> for <a href=\"https://make.wordpress.org/core/tag/6-6/\">6.6-related posts</a> in the next few weeks for further details.</p>\n\n\n\n<h2 class=\"wp-block-heading\">What&#8217;s in WordPress 6.6 RC2?</h2>\n\n\n\n<p>Thanks to your testing and many other contributors‘ up to now, this release includes more than 19 bug fixes for the Editor and more than <a href=\"https://core.trac.wordpress.org/query?status=closed&amp;changetime=06%2F25%2F2024..07%2F01%2F2024&amp;milestone=6.6&amp;col=id&amp;col=milestone&amp;col=owner&amp;col=type&amp;col=priority&amp;order=id\">20 tickets for WordPress Core</a>.</p>\n\n\n\n<p>Get a recap of WordPress 6.6’s highlighted features in the <a href=\"https://wordpress.org/news/2024/06/wordpress-6-6-beta-1/\" data-type=\"post\" data-id=\"17289\">Beta 1 announcement</a>. For more technical information related to issues addressed since Beta 3, you can browse the following links:</p>\n\n\n\n<ul class=\"wp-block-list\">\n<li><a href=\"https://github.com/WordPress/gutenberg/commits/wp/6.6?since=2024-06-24&amp;until=2024-06-30\">GitHub commits for 6.6</a> since June 25</li>\n\n\n\n<li><a href=\"https://core.trac.wordpress.org/query?status=closed&amp;changetime=06%2F25%2F2024..07%2F01%2F2024&amp;milestone=6.6&amp;col=id&amp;col=milestone&amp;col=owner&amp;col=type&amp;col=priority&amp;order=id\">Closed Trac tickets</a> since June 25</li>\n</ul>\n\n\n\n<p>Want to look deeper into the details and technical notes for this release? You might want to make your first stop <a href=\"https://make.wordpress.org/core/2024/06/25/wordpress-6-6-field-guide/\">The WordPress 6.6 Field Guide</a>. Then, check out this list:</p>\n\n\n\n<ul class=\"wp-block-list\">\n<li><a href=\"https://make.wordpress.org/core/2024/06/20/roster-of-design-tools-per-block-wordpress-6-6-edition/\">Roster of design tools per block (WordPress 6.6 edition)</a></li>\n\n\n\n<li><a href=\"https://make.wordpress.org/core/2024/07/01/hallway-hangout-section-styles-and-other-block-style-variation-updates/\">Hallway Hangout: Section styles and other block style variation updates</a></li>\n\n\n\n<li><a href=\"https://make.wordpress.org/core/2024/07/01/recap-hallway-hangout-exploring-grid-layouts/\">Recap Hallway Hangout: Exploring Grid Layouts</a></li>\n\n\n\n<li><a href=\"https://make.wordpress.org/core/2024/06/28/editing-custom-fields-from-connected-blocks/\">Editing custom fields from connected blocks</a></li>\n\n\n\n<li><a href=\"https://make.wordpress.org/core/2024/06/28/updates-to-the-interactivity-api-in-6-6/\">Updates to the Interactivity API in 6.6</a></li>\n\n\n\n<li><a href=\"https://make.wordpress.org/core/tag/dev-notes+6-6/\">All 6.6-related developer notes</a></li>\n</ul>\n\n\n\n<h2 class=\"wp-block-heading\">You can contribute. Here&#8217;s how</h2>\n\n\n\n<p>WordPress is the world’s most popular open source web platform, thanks to a passionate community of people who collaborate on its development in a wide variety of ways. You can help—whether or not you have any technical expertise.</p>\n\n\n\n<h3 class=\"wp-block-heading\">Get involved in testing</h3>\n\n\n\n<p>Testing for issues is critical to keeping WordPress speedy, stable, and secure. It’s also a vital way for anyone to contribute. <a href=\"https://make.wordpress.org/test/2024/06/03/help-test-wordpress-6-6/\" data-type=\"post\" data-id=\"17392\">This detailed guide</a> will walk you through testing features in WordPress 6.6. If you&#8217;re new to testing, follow <a href=\"https://make.wordpress.org/test/2024/06/03/help-test-wordpress-6-6/\" data-type=\"post\" data-id=\"17289\">this general testing guide</a> for more details on getting set up.</p>\n\n\n\n<p>If you encounter an issue, please report it to the <a href=\"https://wordpress.org/support/forum/alphabeta/\">Alpha/Beta area</a> of the support forums. If you are comfortable writing a reproducible bug report, you can also report it on <a href=\"https://core.trac.wordpress.org/newticket\">WordPress Trac</a>. Before you do either, you may want to check your issue against a list of <a href=\"https://core.trac.wordpress.org/tickets/major\">known bugs</a>.</p>\n\n\n\n<p>Curious about testing releases in general? Follow along with the <a href=\"https://make.wordpress.org/test/\">testing initiatives in Make Core</a> and join the <a href=\"https://wordpress.slack.com/messages/core-test/\">#core-test channel</a> on <a href=\"https://wordpress.slack.com/\">Making WordPress Slack</a>.</p>\n\n\n\n<h3 class=\"wp-block-heading\">Search for vulnerabilities</h3>\n\n\n\n<p>From now until the final release candidate of WordPress 6.6 (scheduled for July 9), the <a href=\"https://make.wordpress.org/security/2024/06/04/wordpress-6-6-is-coming/\">financial reward for reporting new, unreleased security vulnerabilities</a> doubles. Please follow responsible disclosure practices as detailed in the project’s security practices and policies outlined on the <a href=\"https://hackerone.com/wordpress\">HackerOne page</a> and in the <a href=\"https://wordpress.org/about/security/\">security white paper</a>.</p>\n\n\n\n<h3 class=\"wp-block-heading\">Update your theme or plugin</h3>\n\n\n\n<p>If you build themes, plugins, blocks, or patterns, your products play an integral role in extending the functionality and value of WordPress for all users. </p>\n\n\n\n<p>Thanks for continuing to test your products with the WordPress 6.6 beta releases. With RC2, you’ll want to finish your testing and update the <em>“Tested up to”</em> version in your <a href=\"https://developer.wordpress.org/plugins/wordpress-org/how-your-readme-txt-works/\">plugin’s readme file</a> to 6.6.</p>\n\n\n\n<p>If you find compatibility issues, please post detailed information to the <a href=\"https://wordpress.org/support/forum/alphabeta/\">support forum</a>.</p>\n\n\n\n<h3 class=\"wp-block-heading\">Help translate WordPress</h3>\n\n\n\n<p>Do you speak a language other than English? <bdo lang=\"es\" dir=\"ltr\">¿Español?</bdo> <bdo lang=\"fr\" dir=\"ltr\">Français?</bdo> <bdo lang=\"ru\" dir=\"ltr\">Русский</bdo>? <bdo lang=\"ja\" dir=\"ltr\">日本</bdo>語? <bdo lang=\"hin\" dir=\"ltr\">हिन्दी</bdo>? <bdo lang=\"bn\" dir=\"ltr\">বাংলা</bdo>? You can <a href=\"https://translate.wordpress.org/projects/wp/dev/\">help translate WordPress into more than 100 languages</a>.</p>\n\n\n\n<h2 class=\"wp-block-heading\">Release the haiku</h2>\n\n\n\n<p>6.6 draws near.<br>In two weeks the final&#8217;s here.<br>Test. Test. Then test more.</p>\n\n\n\n<p class=\"has-text-align-right\"><em>Props to <a href=\'https://profiles.wordpress.org/juanmaguitar/\' class=\'mention\'><span class=\'mentions-prefix\'>@</span>juanmaguitar</a>, <a href=\'https://profiles.wordpress.org/meher/\' class=\'mention\'><span class=\'mentions-prefix\'>@</span>meher</a>, <a href=\'https://profiles.wordpress.org/desrosj/\' class=\'mention\'><span class=\'mentions-prefix\'>@</span>desrosj</a></em> <em>and <a href=\'https://profiles.wordpress.org/atachibana/\' class=\'mention\'><span class=\'mentions-prefix\'>@</span>atachibana</a> for peer review.</em></p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:30:\"com-wordpress:feed-additions:1\";a:1:{s:7:\"post-id\";a:1:{i:0;a:5:{s:4:\"data\";s:5:\"17469\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:6;a:6:{s:4:\"data\";s:69:\"\n		\n		\n		\n		\n		\n				\n		\n		\n		\n		\n		\n\n					\n										\n					\n		\n		\n			\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:4:{s:0:\"\";a:6:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:33:\"WordPress 6.6 Release Candidate 1\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:69:\"https://wordpress.org/news/2024/06/wordpress-6-6-release-candidate-1/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 25 Jun 2024 16:23:50 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:5:{i:0;a:5:{s:4:\"data\";s:11:\"Development\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:1;a:5:{s:4:\"data\";s:8:\"Releases\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:2;a:5:{s:4:\"data\";s:3:\"6.6\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:3;a:5:{s:4:\"data\";s:11:\"development\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:4;a:5:{s:4:\"data\";s:8:\"releases\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:35:\"https://wordpress.org/news/?p=17429\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:356:\"The first release candidate (RC1) for WordPress 6.6 is ready for download and testing! This version of the WordPress software is under development. Please do not install, run, or test this version of WordPress on production or mission-critical websites. Instead, please evaluate RC1 on a test server or a local environment. Reaching this phase of [&#8230;]\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:8:\"marybaum\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:11225:\"\n<p>The first release candidate (RC1) for WordPress 6.6 is ready for download and testing!</p>\n\n\n\n<p><strong>This version of the WordPress software is under development</strong>.<strong> Please do not install, run, or test this version of WordPress on production or mission-critical websites.</strong> Instead, please evaluate RC1 on a test server or a local environment.</p>\n\n\n\n<p>Reaching this phase of the release cycle is a worthy achievement. While release candidates are considered ready for release, testing is still vital to make sure everything in WordPress 6.6 is the best it can be.</p>\n\n\n\n<p>You can test WordPress 6.6 RC1 in four ways:</p>\n\n\n\n<figure class=\"wp-block-table\"><table><tbody><tr><th>Plugin</th><td>Install and activate the <a href=\"https://wordpress.org/plugins/wordpress-beta-tester/\">WordPress Beta Tester</a> plugin on a WordPress install. (Select the “Bleeding edge” channel and “Beta/RC Only” stream).</td></tr><tr><th>Direct Download</th><td>Download the <a href=\"https://wordpress.org/wordpress-6.6-RC1.zip\">RC1 version (zip)</a> and install it on a WordPress website.</td></tr><tr><th>Command Line</th><td>Use the this <a href=\"https://make.wordpress.org/cli/\">WP-CLI</a> command:<br><code>wp core update --version=6.6-RC1</code></td></tr><tr><th>WordPress Playground</th><td>Use the <a href=\"https://playground.wordpress.net/#%7B%20%22preferredVersions%22:%20%7B%20%22php%22:%20%228.0%22,%20%22wp%22:%20%22beta%22%20%7D,%20%22features%22:%20%7B%20%22networking%22:%20true%20%7D,%20%22steps%22:%20[%20%7B%20%22step%22:%20%22login%22,%20%22username%22:%20%22admin%22,%20%22password%22:%20%22password%22%20%7D,%20%7B%20%22step%22:%20%22importFile%22,%20%22file%22:%20%7B%20%22resource%22:%20%22url%22,%20%22url%22:%20%22https://raw.githubusercontent.com/wpaccessibility/a11y-theme-unit-test/master/a11y-theme-unit-test-data.xml%22%20%7D%20%7D,%20%7B%20%22step%22:%20%22importFile%22,%20%22file%22:%20%7B%20%22resource%22:%20%22url%22,%20%22url%22:%20%22https://raw.githubusercontent.com/WordPress/theme-test-data/master/themeunittestdata.wordpress.xml%22%20%7D%20%7D,%20%7B%20%22step%22:%20%22installPlugin%22,%20%22pluginZipFile%22:%20%7B%20%22resource%22:%20%22wordpress.org/plugins%22,%20%22slug%22:%20%22query-monitor%22%20%7D,%20%22options%22:%20%7B%20%22activate%22:%20false%20%7D,%20%22progress%22:%20%7B%20%22weight%22:%202%20%7D%20%7D,%20%7B%20%22step%22:%20%22installPlugin%22,%20%22pluginZipFile%22:%20%7B%20%22resource%22:%20%22wordpress.org/plugins%22,%20%22slug%22:%20%22create-block-theme%22%20%7D,%20%22progress%22:%20%7B%20%22weight%22:%202%20%7D%20%7D,%20%7B%20%22step%22:%20%22installPlugin%22,%20%22pluginZipFile%22:%20%7B%20%22resource%22:%20%22wordpress.org/plugins%22,%20%22slug%22:%20%22debug-bar%22%20%7D,%20%22progress%22:%20%7B%20%22weight%22:%202%20%7D%20%7D,%20%7B%20%22step%22:%20%22installPlugin%22,%20%22pluginZipFile%22:%20%7B%20%22resource%22:%20%22wordpress.org/plugins%22,%20%22slug%22:%20%22health-check%22%20%7D,%20%22progress%22:%20%7B%20%22weight%22:%202%20%7D%20%7D,%20%7B%20%22step%22:%20%22installPlugin%22,%20%22pluginZipFile%22:%20%7B%20%22resource%22:%20%22wordpress.org/plugins%22,%20%22slug%22:%20%22test-reports%22%20%7D,%20%22progress%22:%20%7B%20%22weight%22:%202%20%7D%20%7D,%20%7B%20%22step%22:%20%22installPlugin%22,%20%22pluginZipFile%22:%20%7B%20%22resource%22:%20%22wordpress.org/plugins%22,%20%22slug%22:%20%22user-switching%22%20%7D,%20%22progress%22:%20%7B%20%22weight%22:%202%20%7D%20%7D%20]%20%7D\">6.6 RC1 WordPress Playground instance</a> (available within 35 minutes after the release is ready) to test the software directly in your browser without the need for a separate site or setup.</td></tr></tbody></table><figcaption class=\"wp-element-caption\">Please test WordPress 6.6 RC1 in one or more of these four ways.</figcaption></figure>\n\n\n\n<p>The current target for the WordPress 6.6 release is <strong>July 16, 2024</strong>. Get an overview of the <a href=\"https://make.wordpress.org/core/6-6/\">6.6 release cycle</a>, and check the <a href=\"https://make.wordpress.org/core/\">Make WordPress Core blog</a> for <a href=\"https://make.wordpress.org/core/tag/6-6/\">6.6-related posts</a> in the next few weeks for further details.</p>\n\n\n\n<h2 class=\"wp-block-heading\">Two notes about changes in the RC period</h2>\n\n\n\n<p><strong>Hard string freeze:</strong> From now until July 16, there is a <a href=\"https://make.wordpress.org/polyglots/handbook/glossary/#hard-freeze\">hard string freeze</a> in place—no strings may change, and no new strings may be committed. That&#8217;s to give the Polyglots team time to translate WordPress 6.6 into as many languages as possible before final release.</p>\n\n\n\n<p><strong>Two-committer signoff:</strong> Commits in the RC period also require two Core committers to sign off on every merge. Since release candidates are supposed to be ready to go, only major fixes and blessed tasks should merge at this late date.</p>\n\n\n\n<h2 class=\"wp-block-heading\">What&#8217;s in WordPress 6.6 RC1?</h2>\n\n\n\n<p>Thanks to your testing and many other contributors‘ up to now, this release includes more than 40 bug fixes for the Editor and more than <a href=\"https://core.trac.wordpress.org/query?status=closed&amp;changetime=02%2F27%2F2024..03%2F05%2F2024&amp;milestone=6.5&amp;col=id&amp;col=milestone&amp;col=owner&amp;col=type&amp;col=priority&amp;order=id\">40 tickets for WordPress Core</a>.</p>\n\n\n\n<p>Get a recap of WordPress 6.6’s highlighted features in the <a href=\"https://wordpress.org/news/2024/06/wordpress-6-6-beta-1/\" data-type=\"post\" data-id=\"17289\">Beta 1 announcement</a>. For more technical information related to issues addressed since Beta 3, you can browse the following links:</p>\n\n\n\n<ul class=\"wp-block-list\">\n<li><a href=\"https://github.com/WordPress/gutenberg/commits/wp/6.6?since=2024-06-18&amp;until=2024-06-24\">GitHub commits for 6.6</a> since June 18</li>\n\n\n\n<li><a href=\"https://core.trac.wordpress.org/query?status=closed&amp;changetime=06%2F18%2F24..06%2F24%2F2024&amp;milestone=6.6&amp;max=1000&amp;col=id&amp;col=milestone&amp;col=owner&amp;col=type&amp;col=priority&amp;order=id\">Closed Trac tickets</a> since June 18</li>\n</ul>\n\n\n\n<p>Want to look deeper into the details and technical notes for this release? These recent posts cover some of the latest updates:</p>\n\n\n\n<ul class=\"wp-block-list\">\n<li><a href=\"https://make.wordpress.org/core/2024/06/21/wordpress-6-6-css-specificity/\">WordPress 6.6 CSS Specificity</a></li>\n\n\n\n<li><a href=\"https://make.wordpress.org/core/2024/06/20/site-wide-background-images-in-wordpress-6-6/\">Site-wide background images in WordPress 6.6</a></li>\n\n\n\n<li><a href=\"https://make.wordpress.org/core/2024/06/24/section-styles/\">Section Styles</a></li>\n\n\n\n<li><a href=\"https://make.wordpress.org/core/2024/06/20/roster-of-design-tools-per-block-wordpress-6-6-edition/\">Roster of design tools per block (WordPress 6.6 edition)</a></li>\n\n\n\n<li><a href=\"https://make.wordpress.org/core/2024/06/25/wordpress-6-6-field-guide/\">The WordPress 6.6 Field Guide</a></li>\n\n\n\n<li><a href=\"https://make.wordpress.org/core/tag/dev-notes-6-6/\">All 6.6-related developer notes</a></li>\n</ul>\n\n\n\n<h2 class=\"wp-block-heading\">How you can contribute</h2>\n\n\n\n<p>WordPress is open source software made possible by a passionate community of people who collaborate on and contribute to to its development. The resources below outline a wide variety of ways you can help the world’s most popular open source web platform, whether or not you have any technical expertise.</p>\n\n\n\n<h3 class=\"wp-block-heading\">Get involved in testing</h3>\n\n\n\n<p>Testing for issues is critical to making sure WordPress is speedy and stable. It’s also a vital way for anyone to contribute. <a href=\"https://make.wordpress.org/test/2024/06/03/help-test-wordpress-6-6/\" data-type=\"post\" data-id=\"17392\">This detailed guide</a> will walk you through testing features in WordPress 6.6. If you&#8217;re new to testing, follow <a href=\"https://make.wordpress.org/test/2024/06/03/help-test-wordpress-6-6/\" data-type=\"post\" data-id=\"17289\">this general testing guide</a> for more details on getting set up.</p>\n\n\n\n<p>If you encounter an issue, please report it to the <a href=\"https://wordpress.org/support/forum/alphabeta/\">Alpha/Beta area</a> of the support forums. If you are comfortable writing a reproducible bug report, you can also report it on <a href=\"https://core.trac.wordpress.org/newticket\">WordPress Trac</a>. Before you do either, you may want to check your issue against a list of <a href=\"https://core.trac.wordpress.org/tickets/major\">known bugs</a>.</p>\n\n\n\n<p>Curious about testing releases in general? Follow along with the <a href=\"https://make.wordpress.org/test/\">testing initiatives in Make Core</a> and join the <a href=\"https://wordpress.slack.com/messages/core-test/\">#core-test channel</a> on <a href=\"https://wordpress.slack.com/\">Making WordPress Slack</a>.</p>\n\n\n\n<h3 class=\"wp-block-heading\">Search for vulnerabilities</h3>\n\n\n\n<p>From now until the final release candidate of WordPress 6.6 (scheduled for July 16), the <a href=\"https://make.wordpress.org/security/2024/06/04/wordpress-6-6-is-coming/\">monetary reward for reporting new, unreleased security vulnerabilities</a> doubles. Please follow responsible disclosure practices as detailed in the project’s security practices and policies outlined on the <a href=\"https://hackerone.com/wordpress\">HackerOne page</a> and in the <a href=\"https://wordpress.org/about/security/\">security white paper</a>.</p>\n\n\n\n<h3 class=\"wp-block-heading\">Update your theme or plugin</h3>\n\n\n\n<p>If you build themes, plugins, blocks or patterns, your products play an integral role in extending the functionality and value of WordPress for all users.&nbsp;</p>\n\n\n\n<p>Thanks for continuing to test your themes and plugins with the WordPress 6.6 beta releases. With RC1, you’ll want to finish your testing and update the <em>“Tested up to”</em> version in your <a href=\"https://developer.wordpress.org/plugins/wordpress-org/how-your-readme-txt-works/\">plugin’s readme file</a> to 6.6.</p>\n\n\n\n<p>If you find compatibility issues, please post detailed information to the <a href=\"https://wordpress.org/support/forum/alphabeta/\">support forum</a>.</p>\n\n\n\n<h3 class=\"wp-block-heading\">Help translate WordPress</h3>\n\n\n\n<p>Do you speak a language other than English? <bdo lang=\"es\" dir=\"ltr\">¿Español?</bdo> <bdo lang=\"fr\" dir=\"ltr\">Français?</bdo> <bdo lang=\"ru\" dir=\"ltr\">Русский</bdo>? <bdo lang=\"ja\" dir=\"ltr\">日本</bdo>語? <bdo lang=\"hin\" dir=\"ltr\">हिन्दी</bdo>? <bdo lang=\"bn\" dir=\"ltr\">বাংলা</bdo>? You can <a href=\"https://translate.wordpress.org/projects/wp/dev/\">help translate WordPress into more than 100 languages</a>.</p>\n\n\n\n<h2 class=\"wp-block-heading\">Release the haiku</h2>\n\n\n\n<p>We&#8217;re here already?<br>RC1 means three weeks left.<br>Have some fun—come test!</p>\n\n\n\n<p><em>Props to <a href=\'https://profiles.wordpress.org/meher/\' class=\'mention\'><span class=\'mentions-prefix\'>@</span>meher</a>, <a href=\'https://profiles.wordpress.org/audrasjb/\' class=\'mention\'><span class=\'mentions-prefix\'>@</span>audrasjb</a> for collaborating on this post.</em></p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:30:\"com-wordpress:feed-additions:1\";a:1:{s:7:\"post-id\";a:1:{i:0;a:5:{s:4:\"data\";s:5:\"17429\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:7;a:6:{s:4:\"data\";s:63:\"\n		\n		\n		\n		\n		\n				\n		\n		\n		\n\n					\n										\n					\n		\n		\n			\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:4:{s:0:\"\";a:6:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:15:\"WordPress 6.5.5\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:51:\"https://wordpress.org/news/2024/06/wordpress-6-5-5/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Mon, 24 Jun 2024 19:10:30 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:3:{i:0;a:5:{s:4:\"data\";s:8:\"Releases\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:1;a:5:{s:4:\"data\";s:8:\"Security\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:2;a:5:{s:4:\"data\";s:11:\"development\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:35:\"https://wordpress.org/news/?p=17426\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:377:\"WordPress 6.5.5 is now available! This release features three security fixes. Because this is a security release, it is recommended that you update your sites immediately. This minor release also includes 3 bug fixes in Core. You can download WordPress 6.5.5 from WordPress.org, or visit your WordPress Dashboard, click “Updates”, and then click “Update Now”. [&#8230;]\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:12:\"Aaron Jorbin\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:5127:\"\n<h2 class=\"wp-block-heading\">WordPress 6.5.5 is now available!</h2>\n\n\n\n<p>This release features three security fixes. Because this is a security release, <strong>it is recommended that you update your sites immediately. </strong>This minor release also includes <a href=\"https://core.trac.wordpress.org/query?component=!Build%2FTest+Tools&amp;milestone=6.5.5&amp;col=id&amp;col=summary&amp;col=owner&amp;col=type&amp;col=status&amp;col=priority&amp;col=component&amp;order=priority\">3 bug fixes</a> in Core.</p>\n\n\n\n<p>You can <a href=\"https://wordpress.org/wordpress-6.5.5.zip\">download WordPress 6.5.5 from WordPress.org</a>, or visit your WordPress Dashboard, click “Updates”, and then click “Update Now”. If you have sites that support automatic background updates, the update process will begin automatically.</p>\n\n\n\n<p>WordPress 6.5.5 is a short-cycle release. The next major release will be version 6.6 which is scheduled for July 16, 2024.</p>\n\n\n\n<p>For more information on WordPress 6.5.5, please visit the <a href=\"https://wordpress.org/documentation/wordpress-version/version-6-5-5/\">HelpHub site</a>.</p>\n\n\n\n<h2 class=\"wp-block-heading\">Security updates included in this release</h2>\n\n\n\n<p>The security team would like to thank the following people for <a href=\"https://hackerone.com/wordpress?type=team\">responsibly reporting vulnerabilities</a>, and allowing them to be fixed in this release:</p>\n\n\n\n<ul class=\"wp-block-list\">\n<li>A cross-site scripting (XSS) vulnerability affecting the HTML API reported by Dennis Snell of the WordPress Core Team, along with Alex Concha and Grzegorz (Greg) Ziółkowski of the WordPress security team.</li>\n\n\n\n<li>A cross-site scripting (XSS) vulnerability affecting the Template Part block reported independently by Rafie Muhammad of Patchstack and during a third party security audit.</li>\n\n\n\n<li>A path traversal issue affecting sites hosted on Windows reported independently by Rafie M &amp; Edouard L of Patchstack, David Fifield, <a href=\"https://hackerone.com/x89\">x89</a>, <a href=\"https://hackerone.com/apple502j\">apple502j</a>, and <a href=\"https://hackerone.com/mishre\">mishre</a>.</li>\n</ul>\n\n\n\n<h2 class=\"wp-block-heading\">Thank you to these WordPress contributors</h2>\n\n\n\n<p>This release was led by <a href=\"https://profiles.wordpress.org/jorbin/\">Aaron Jorbin</a>.</p>\n\n\n\n<p>WordPress 6.5.5 would not have been possible without the contributions of the following people. Their asynchronous coordination to deliver maintenance and security fixes into a stable release is a testament to the power and capability of the WordPress community.</p>\n\n\n\n<p class=\"is-style-wporg-props-medium\"><a href=\"https://profiles.wordpress.org/jorbin\">Aaron Jorbin</a>, <a href=\"https://profiles.wordpress.org/xknown\">Alex Concha</a>, <a href=\"https://profiles.wordpress.org/azaozz\">Andrew Ozz</a>, <a href=\"https://profiles.wordpress.org/bernhard-reiter\">bernhard-reiter</a>, <a href=\"https://profiles.wordpress.org/costdev\">Colin Stewart</a>, <a href=\"https://profiles.wordpress.org/davidbaumwald/\">David Baumwald</a>, <a href=\"https://profiles.wordpress.org/dmsnell\">Dennis Snell</a>, <a href=\"https://profiles.wordpress.org/grantmkin\">Grant M. Kinney</a>, <a href=\"https://profiles.wordpress.org/gziolo\">Greg Ziółkowski</a>, <a href=\"https://profiles.wordpress.org/audrasjb\">Jb Audras</a>, <a href=\"https://profiles.wordpress.org/desrosj\">Jonathan Desrosiers</a>, <a href=\"https://profiles.wordpress.org/matveb\">Matias Ventura</a>, <a href=\"https://profiles.wordpress.org/mcsf\">Miguel Fonseca</a>, <a href=\"https://profiles.wordpress.org/peterwilsoncc\">Peter Wilson</a>, <a href=\"https://profiles.wordpress.org/rajinsharwar\">Rajin Sharwar</a>, <a href=\"https://profiles.wordpress.org/coffee2code\">Scott Reilly</a>, <a href=\"https://profiles.wordpress.org/hellofromTonya\">Tonya Mork</a></p>\n\n\n\n<h2 class=\"wp-block-heading\">How to contribute</h2>\n\n\n\n<p>To get involved in WordPress core development, head over to Trac, <a href=\"https://core.trac.wordpress.org/report/6\">pick a ticket</a>, and join the conversation in the <a href=\"https://wordpress.slack.com/archives/C02RQBWTW\">#core</a> Slack channel. Need help? Check out the <a href=\"https://make.wordpress.org/core/handbook/tutorials/faq-for-new-contributors/\">Core Contributor Handbook</a>.</p>\n\n\n\n<p><em>Already testing WordPress 6.6? The fourth beta is now available (<a href=\"https://wordpress.org/wordpress-6.6-beta4.zip\">zip</a>) and it contains these security fixes. For more on 6.6, see the <a href=\"https://wordpress.org/news/2024/06/wordpress-6-6-beta-3/\">beta 3 announcement post</a>. Learn more about <a href=\"https://make.wordpress.org/test/2024/06/03/help-test-wordpress-6-6/\">testing WordPress 6.6 here</a>.</em></p>\n\n\n\n<p>Props to <a href=\"https://profiles.wordpress.org/paulkevan/\">Paul Kevan</a>, <a href=\"https://profiles.wordpress.org/ehtis/\">Ehtisham Siddiqui</a>, <a href=\"https://profiles.wordpress.org/xknown/\">Alex Concha</a>, <a href=\"https://profiles.wordpress.org/hellofromTonya\">Tonya Mork</a>, and <a href=\"https://profiles.wordpress.org/angelasjin/\">Angela Jin</a> for reviewing.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:30:\"com-wordpress:feed-additions:1\";a:1:{s:7:\"post-id\";a:1:{i:0;a:5:{s:4:\"data\";s:5:\"17426\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:8;a:6:{s:4:\"data\";s:61:\"\n		\n		\n		\n		\n		\n				\n		\n		\n\n					\n										\n					\n		\n		\n\n			\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:4:{s:0:\"\";a:7:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:43:\"WP Briefing: Episode 82: WCEU Hallway Track\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:65:\"https://wordpress.org/news/2024/06/episode-82-wceu-hallway-track/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Mon, 24 Jun 2024 12:00:00 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:2:{i:0;a:5:{s:4:\"data\";s:7:\"Podcast\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:1;a:5:{s:4:\"data\";s:11:\"wp-briefing\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:53:\"https://wordpress.org/news/?post_type=podcast&p=17409\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:312:\"Big events create big moments, and WordCamp Europe 2024 was no exception. Join host Josepha Haden Chomphosy on this episode of the WordPress Briefing as she shares her top insights  and favorite highlights from the event. Discover what the WordPress community focused on during this exciting three-day gathering.\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:9:\"enclosure\";a:1:{i:0;a:5:{s:4:\"data\";s:0:\"\";s:7:\"attribs\";a:1:{s:0:\"\";a:3:{s:3:\"url\";s:51:\"https://wordpress.org/news/files/2024/06/WPB082.mp3\";s:6:\"length\";s:1:\"0\";s:4:\"type\";s:0:\"\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:14:\"Brett McSherry\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:10086:\"\n<p>Big events create big moments, and WordCamp Europe 2024 was no exception. Join host Josepha Haden Chomphosy on this episode of the WordPress Briefing as she shares her top insights  and favorite highlights from the event. Discover what the WordPress community focused on during this exciting three-day gathering.</p>\n\n\n\n<h2 class=\"wp-block-heading\">Credits</h2>\n\n\n\n<p>Host:&nbsp;<a href=\"https://profiles.wordpress.org/chanthaboune/\">Josepha Haden Chomphosy</a><br>Editor:&nbsp;<a href=\"https://profiles.wordpress.org/dustinhartzler/\">Dustin Hartzler</a><br>Logo:&nbsp;<a href=\"https://profiles.wordpress.org/javiarce/\">Javier Arce</a><br>Production:&nbsp;<a href=\"https://profiles.wordpress.org/bjmcsherry/\">Brett McSherry</a><br>Song: Fearless First by Kevin MacLeod</p>\n\n\n\n<h2 class=\"wp-block-heading\">Show Notes</h2>\n\n\n\n<ul class=\"wp-block-list\">\n<li><a href=\"https://europe.wordcamp.org/\">WordCamp Europe</a></li>\n\n\n\n<li><strong>Small List of Big Things</strong>\n<ul class=\"wp-block-list\">\n<li><a href=\"https://make.wordpress.org/core/6-6/\">WordPress 6.6 RC1 (and upcoming schedule)</a></li>\n\n\n\n<li><a href=\"https://make.wordpress.org/project/2024/05/31/wordpress-project-contributor-handbook-v2/\">WordPress Project Contributor Handbook v2</a></li>\n\n\n\n<li><a href=\"https://make.wordpress.org/sustainability/2024/06/12/the-sustainability-teams-handbook-for-events-is-here/\">The Sustainability Team’s Handbook for Events&nbsp;is here!</a></li>\n\n\n\n<li><a href=\"https://us.wordcamp.org/2024/volunteering-at-wordcamp-us-2024/\">Volunteering at WordCamp US 2024</a>&nbsp;</li>\n</ul>\n</li>\n\n\n\n<li>Have a question you’d like answered? Submit them to&nbsp;<a href=\"mailto:wpbriefing@WordPress.org\">WPBriefing@WordPress.org</a>.</li>\n</ul>\n\n\n\n<h2 class=\"wp-block-heading\">Transcript</h2>\n\n\n\n<p>[00:00:00]&nbsp;<strong>Josepha:</strong>&nbsp;Hello, everyone, and welcome to the WordPress Briefing, the podcast where you can catch quick explanations of the ideas behind the WordPress open source project, some insight into the community that supports it, and get a small list of big things coming up in the next two weeks. I’m your host, Josepha Haden Chomphosy. Here we go.</p>\n\n\n\n<p>[00:00:28] (Intro music)&nbsp;</p>\n\n\n\n<p>[00:00:40]&nbsp;<strong>Josepha:</strong> My friends, another WordCamp Europe is in the books. We had the second-highest number of tickets sold in the history of our event series, with the first being WordCamp Europe in Berlin. But even with that number of tickets sold, that number of people gathering together to talk about WordPress and related things, there were still a lot of people who didn&#8217;t get to join us.</p>\n\n\n\n<p>[00:01:01] <strong>Josepha:</strong> For some, that came with experiencing FOMO, but some of you embraced the JOMO of it all. Either way, at this point, there are a good collection of wrap-ups and round-ups going around, so I&#8217;m here to tell you a bit about what was buzzing in the hallway track.&nbsp;</p>\n\n\n\n<p>Firstly, everyone was so excited to see old friends and make new ones. Everywhere I turned, I saw WordPressers in clusters catching up, most included new to the crew faces. So we know that we were using the Pac-Man rule that we love so much. But even while they were catching up on the last two, three, four years, they were also talking to each other about how to get more folks to things like this. </p>\n\n\n\n<p>Since we all generally agree that your first time meeting other WordPressers can be a truly pivotal moment in your WordPress journey, it was a delight to hear so much brainstorming focused on that. From mentorship to community introduction and the future of our events, the question of how to keep our ecosystem healthy and thriving was a big topic. Does any one of us have all the answers to this? No, but fortunately, we&#8217;ve got a global set of thinkers working on this global question. So, together, I&#8217;m sure we can come up with some good guesses to try out.</p>\n\n\n\n<p>[00:02:21] <strong>Josepha:</strong> Secondly, I saw a ton of talks and discussions about career development, not only about how to learn more but also how to be a champion for open source in your company, how to advocate for contribution as a best business practice. And what other communities can teach us about how they commit to their user&#8217;s continuing education, for lack of a friendlier term.</p>\n\n\n\n<p>And boy, do I love a good conversation about how to make working in open source easier, make it more meaningful, and more impactful. I&#8217;m in favor of anything that helps to dignify our profession. The front-facing, easy-to-use experience of WordPress, in particular, has been misunderstood to mean that we are a simple piece of software for simple tasks. And that is the way with our mission really. If we succeed at democratizing publishing or learning or commerce for that matter, we are taking the arcane and making it mundane. But simple to use doesn&#8217;t mean simple to create. And I want all of our future employers and clients to see that.</p>\n\n\n\n<p>[00:03:24] <strong>Josepha:</strong> And then the final thing that I saw lighting up the hallway track was the idea of bringing life and excitement back to the web. WordPress has been fighting against closed systems for a long time, but as Matt alluded to in his keynote, merely having an open web is still not quite as fun as having an active and dynamic one. And we saw that both in general desire to bring fun back to being online, but also in the fresh variety of demos and workshops that we saw in the fun that was brought to the event. There were new and shocking implementations of Playground, I must say. Which, as far as I can tell, will basically be able to run everything one day.</p>\n\n\n\n<p>[00:04:03] <strong>Josepha:</strong> But at WordCamp Europe, it ran; it powered our second massive hybrid translation event, where we translated something like 50,000 strings. We also had an amazing speed-building duel with an accepted future challenge between Jessica Lyschik and Matt Mullenweg. And not for nothing; the way we designed; the way the event area was put together included ways to stop and just have fun.</p>\n\n\n\n<p>There was a little grassy area with yard games and smaller pods of chairs for those quick hallway catch-ups that you just don&#8217;t get anywhere else. And for me, it was simply lovely to see everyone embracing the fun that was there, but also hearing about how much they wanted to help the web embrace the fun that could be.</p>\n\n\n\n<p>[00:04:48] (Music interlude)&nbsp;</p>\n\n\n\n<p>[00:04:55] <strong>Josepha:</strong> Thanks for listening to my hallway track recap. Hopefully, it caused JOMO, not FOMO. And now, let&#8217;s turn our attention to the small list of big things.</p>\n\n\n\n<p>[00:05:05] <strong>Josepha:</strong> First thing on my list is WordPress 6.6 update. So we are reaching the release candidate phase tomorrow. WordPress 6.6 RC1 will be released, so download and join the community helping us to get this release out the door. It is scheduled for July 16th. If you have plugins or themes or any sort of business that uses WordPress, now is the time to get in and test it on a test site. I don&#8217;t recommend putting it in production at any point, but come and test it. Help us break it so that we can make sure that it doesn&#8217;t break for other people, for the, you know, 43% of the web that uses it when we get it out the door on the 16th.&nbsp;</p>\n\n\n\n<p>The second thing on the list is that we have a WordPress Project Contributor Handbook V2 out there. It aims to be the quintessential resource for everyone in our community. And it will provide a bird&#8217;s eye view of where to find key information and different aspects of our community. How it all kind of connects together. And, just like a release, we really need some feedback from you. There is the repo on GitHub where you can go and kind of make inline comments, join the discussion about it. It can be a go-to resource if we look at it together and make sure that it has as much information as clearly stated as you wished you had when you were learning your way around WordPress for the first time.&nbsp;</p>\n\n\n\n<p>[00:06:27] <strong>Josepha:</strong> The third thing on the list is actually another handbook. So, the Sustainability Team has put together a handbook specifically for events. It&#8217;s their first version, and over the past few months, members of that team have been sharing their ideas and experiences on how WordPress community events can be held more sustainably. All this input created a first draft, which eventually became this first version. And so we&#8217;ll put a link in the show notes, wander over there, take a look at it, see what some best practices for sustainable events are in the WordPress ecosystem.&nbsp;</p>\n\n\n\n<p>[00:07:02] <strong>Josepha:</strong> And then the final thing on my list is about WordCamp US. I realize this is a podcast about WordCamp Europe right now. And so it&#8217;s odd to think that I&#8217;m moving right along into WordCamp US. However, there is a deadline coming up. July 1st is the last day to sign up to be a volunteer at this event. It&#8217;s taking place this year in Portland, Oregon, on the west side of the US. And it should be a really fun time. It&#8217;s middle of September. Come on out there. Learn about WordPress. Learn about contribution. Maybe get some voodoo donuts. You know, the important things.&nbsp;</p>\n\n\n\n<p>And that, my friends, is your small list of big things. Don&#8217;t forget to follow us on your favorite podcast app or subscribe directly on WordPress.org/news. You&#8217;ll get a friendly reminder whenever there&#8217;s a new episode. If you liked what you heard today, share it with a fellow WordPresser. Or, if you had questions about what you heard, you can share those with me at WPBriefing@WordPress.org. I am your host, Josepha Haden Chomphosy. Thanks for tuning in today for the WordPress Briefing, and I&#8217;ll see you again in a couple of weeks.&nbsp;</p>\n\n\n\n<p>[00:08:06] (Music outro)&nbsp;</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:30:\"com-wordpress:feed-additions:1\";a:1:{s:7:\"post-id\";a:1:{i:0;a:5:{s:4:\"data\";s:5:\"17409\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:9;a:6:{s:4:\"data\";s:69:\"\n		\n		\n		\n		\n		\n				\n		\n		\n		\n		\n		\n\n					\n										\n					\n		\n		\n			\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:4:{s:0:\"\";a:6:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:20:\"WordPress 6.6 Beta 3\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:56:\"https://wordpress.org/news/2024/06/wordpress-6-6-beta-3/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 18 Jun 2024 16:37:33 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:5:{i:0;a:5:{s:4:\"data\";s:11:\"Development\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:1;a:5:{s:4:\"data\";s:8:\"Releases\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:2;a:5:{s:4:\"data\";s:3:\"6.6\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:3;a:5:{s:4:\"data\";s:11:\"development\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:4;a:5:{s:4:\"data\";s:8:\"releases\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:35:\"https://wordpress.org/news/?p=17392\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:342:\"WordPress 6.6 Beta 3 is here! Please download and test it. This beta version of the WordPress software is under development. Please do not install, run, or test this version of WordPress on production or mission-critical websites—you risk unexpected results if you do. Instead, test Beta 3 on a local site or a testing environment [&#8230;]\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:8:\"marybaum\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:7996:\"\n<p><br>WordPress 6.6 Beta 3 is here! Please download and test it.</p>\n\n\n\n<p id=\"block-79834dd4-c99a-477a-b722-091806a32976\"><strong>This beta version of the WordPress software is under development. </strong>Please do not install, run, or test this version of WordPress on production or mission-critical websites—you risk unexpected results if you do.</p>\n\n\n\n<p id=\"block-aa4b335e-b1a2-4904-a68c-c3e73e574386\">Instead, test Beta 3 on a local site or a testing environment in any of these four ways:</p>\n\n\n\n<figure class=\"wp-block-table\"><table class=\"has-fixed-layout\"><tbody><tr><th>Plugin</th><td>Install and activate the <a href=\"https://wordpress.org/plugins/wordpress-beta-tester/\">WordPress Beta Tester</a> plugin on a WordPress install. (Select the “Bleeding edge” channel and “Beta/RC Only” stream).</td></tr><tr><th>Direct Download</th><td>Download the <a href=\"https://wordpress.org/wordpress-6.6-beta3.zip\">Beta 3 version (zip)</a> and install it on a WordPress website.</td></tr><tr><th>Command Line</th><td>Use this <a href=\"https://make.wordpress.org/cli/\">WP-CLI</a> command:<br><code>wp core update --version=6.6-beta3</code></td></tr><tr><th>WordPress Playground</th><td>Use a <a href=\"https://playground.wordpress.net/#{%20%22preferredVersions%22:%20{%20%22php%22:%20%228.0%22,%20%22wp%22:%20%22beta%22%20},%20%22features%22:%20{%20%22networking%22:%20true%20},%20%22steps%22:%20[%20{%20%22step%22:%20%22login%22,%20%22username%22:%20%22admin%22,%20%22password%22:%20%22password%22%20},%20{%20%22step%22:%20%22importFile%22,%20%22file%22:%20{%20%22resource%22:%20%22url%22,%20%22url%22:%20%22https://raw.githubusercontent.com/wpaccessibility/a11y-theme-unit-test/master/a11y-theme-unit-test-data.xml%22%20}%20},%20{%20%22step%22:%20%22importFile%22,%20%22file%22:%20{%20%22resource%22:%20%22url%22,%20%22url%22:%20%22https://raw.githubusercontent.com/WordPress/theme-test-data/master/themeunittestdata.wordpress.xml%22%20}%20},%20{%20%22step%22:%20%22installPlugin%22,%20%22pluginZipFile%22:%20{%20%22resource%22:%20%22wordpress.org/plugins%22,%20%22slug%22:%20%22query-monitor%22%20},%20%22options%22:%20{%20%22activate%22:%20false%20},%20%22progress%22:%20{%20%22weight%22:%202%20}%20},%20{%20%22step%22:%20%22installPlugin%22,%20%22pluginZipFile%22:%20{%20%22resource%22:%20%22wordpress.org/plugins%22,%20%22slug%22:%20%22create-block-theme%22%20},%20%22progress%22:%20{%20%22weight%22:%202%20}%20},%20{%20%22step%22:%20%22installPlugin%22,%20%22pluginZipFile%22:%20{%20%22resource%22:%20%22wordpress.org/plugins%22,%20%22slug%22:%20%22debug-bar%22%20},%20%22progress%22:%20{%20%22weight%22:%202%20}%20},%20{%20%22step%22:%20%22installPlugin%22,%20%22pluginZipFile%22:%20{%20%22resource%22:%20%22wordpress.org/plugins%22,%20%22slug%22:%20%22health-check%22%20},%20%22progress%22:%20{%20%22weight%22:%202%20}%20},%20{%20%22step%22:%20%22installPlugin%22,%20%22pluginZipFile%22:%20{%20%22resource%22:%20%22wordpress.org/plugins%22,%20%22slug%22:%20%22test-reports%22%20},%20%22progress%22:%20{%20%22weight%22:%202%20}%20},%20{%20%22step%22:%20%22installPlugin%22,%20%22pluginZipFile%22:%20{%20%22resource%22:%20%22wordpress.org/plugins%22,%20%22slug%22:%20%22user-switching%22%20},%20%22progress%22:%20{%20%22weight%22:%202%20}%20}%20]%20}\">6.6 Beta 3 WordPress Playground instance</a> to test the software directly in your browser. This might be the easiest way ever—no separate sites, no setup. Just click and go! </td></tr></tbody></table><figcaption class=\"wp-element-caption\">Four ways to test WordPress Beta 3.</figcaption></figure>\n\n\n\n<p id=\"block-7e6a92e6-dba7-4f69-9226-f4dcab4a0b91\">The target release date for WordPress 6.6 is <strong>July 16, 2024</strong>. Your help testing Beta and RC versions over the next four weeks is vital to making sure the final release is everything it should be: stable, powerful, and intuitive.</p>\n\n\n\n<h2 class=\"wp-block-heading\" id=\"block-aebce12b-08f8-40a7-9fe6-5a08f75d2254\">If you find an issue</h2>\n\n\n\n<p id=\"block-b9e58289-f6cb-4bdd-85a1-eb8d9a704ae4\">If you run into an issue, please share it in the&nbsp;<a href=\"https://wordpress.org/support/forum/alphabeta/\">Alpha/Beta area</a>&nbsp;of the support forums. If you are comfortable submitting a reproducible bug report, you can do so&nbsp;<a href=\"https://core.trac.wordpress.org/newticket\">via WordPress Trac</a>. You can also check your issue against a list of&nbsp;<a href=\"https://core.trac.wordpress.org/tickets/major\">known bugs</a>.</p>\n\n\n\n<h2 class=\"wp-block-heading\">The bug bounty doubles in the beta period</h2>\n\n\n\n<p>The WordPress community sponsors a&nbsp;<a href=\"https://make.wordpress.org/security/2024/06/04/wordpress-6-6-is-coming/\">financial reward for reporting new, unreleased security vulnerabilities.</a>&nbsp;That reward doubles between Beta 1, which landed June 4, and the final Release Candidate (RC), which will happen July 9. Please follow the project’s responsible-disclosure practices detailed on this&nbsp;<a href=\"https://hackerone.com/wordpress\">HackerOne page</a>&nbsp;and in this&nbsp;<a href=\"https://wordpress.org/about/security/\">security white paper</a>.</p>\n\n\n\n<h2 class=\"wp-block-heading\">The work continues</h2>\n\n\n\n<p><strong>Catch up with what&#8217;s new in 6.6:</strong> <a href=\"https://wordpress.org/news/2024/06/wordpress-6-6-beta-1/\" data-type=\"post\" data-id=\"17289\">check out the Beta 1 announcement for the highlights.</a></p>\n\n\n\n<p>Beta 3 packs in more than 50 updates to the Editor since the Beta 2 release, including 39 <a href=\"https://core.trac.wordpress.org/query?status=closed&amp;changetime=06%2F11%2F2024..06%2F16%2[…]id&amp;col=milestone&amp;col=owner&amp;col=type&amp;col=priority&amp;order=id\">tickets for WordPress core</a>:</p>\n\n\n\n<ul class=\"wp-block-list\">\n<li><a href=\"https://github.com/WordPress/gutenberg/commits/trunk?since=2024-06-08&amp;until=2024-06-16\" data-type=\"link\" data-id=\"https://github.com/WordPress/gutenberg/commits/wp/6.5?since=2024-02-14&amp;until=2024-02-20\">GitHub commits for 6.6</a> since June 11</li>\n\n\n\n<li><a href=\"https://core.trac.wordpress.org/query?changetime=06%2F11%2F2024..06%2F16%2F2024&amp;resolution=fixed&amp;milestone=6.6&amp;max=1000&amp;col=id&amp;col=summary&amp;col=milestone&amp;col=owner&amp;col=type&amp;col=status&amp;col=priority&amp;order=milestone\">Closed Trac tickets</a> since June 11</li>\n</ul>\n\n\n\n<p>The beta cycle is all about fixing the bugs you find in testing. </p>\n\n\n\n<p><strong>Do you build themes?</strong>&nbsp;Feedback from testing has already prompted a change in the way you offer style variations to your users.</p>\n\n\n\n<p>In Beta 1, if you made preset style variations for your theme, it automatically generated a full set of color-only and type-only options your users could mix and match across the different variations.</p>\n\n\n\n<p><a href=\"https://github.com/WordPress/gutenberg/pull/62469/commits/83f62ca81ff89b9d395863f6e9b7e82cec76d1b3\">In Beta 3, your theme no longer generates those options automatically—you do.</a> So you can present a simpler set of choices, curated to guide users&#8217; efforts to more pleasing results.&nbsp;<a href=\"https://github.com/WordPress/gutenberg/issues/62285\" target=\"_blank\" rel=\"noreferrer noopener\">For more insight into the rationale, see this discussion.</a></p>\n\n\n\n<p>Thanks again for this all-important contribution to WordPress!</p>\n\n\n\n<p class=\"has-text-align-right is-style-default\"><em>Props to <a href=\'https://profiles.wordpress.org/meher/\' class=\'mention\'><span class=\'mentions-prefix\'>@</span>meher</a>,  <a href=\'https://profiles.wordpress.org/rmartinezduque/\' class=\'mention\'><span class=\'mentions-prefix\'>@</span>rmartinezduque</a></em>,  @<em>atachibana</em>,<em> and  <a href=\'https://profiles.wordpress.org/mobarak/\' class=\'mention\'><span class=\'mentions-prefix\'>@</span>mobarak</a> for collaboration and review.</em></p>\n\n\n\n<h2 class=\"wp-block-heading\">A Beta 3 haiku</h2>\n\n\n\n<p>Beta ends at 3<br>One more week, then comes RC<br>When we freeze the strings!</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:30:\"com-wordpress:feed-additions:1\";a:1:{s:7:\"post-id\";a:1:{i:0;a:5:{s:4:\"data\";s:5:\"17392\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}}}s:27:\"http://www.w3.org/2005/Atom\";a:1:{s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:0:\"\";s:7:\"attribs\";a:1:{s:0:\"\";a:3:{s:4:\"href\";s:32:\"https://wordpress.org/news/feed/\";s:3:\"rel\";s:4:\"self\";s:4:\"type\";s:19:\"application/rss+xml\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:44:\"http://purl.org/rss/1.0/modules/syndication/\";a:2:{s:12:\"updatePeriod\";a:1:{i:0;a:5:{s:4:\"data\";s:9:\"\n	hourly	\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:15:\"updateFrequency\";a:1:{i:0;a:5:{s:4:\"data\";s:4:\"\n	1	\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:30:\"com-wordpress:feed-additions:1\";a:1:{s:4:\"site\";a:1:{i:0;a:5:{s:4:\"data\";s:8:\"14607090\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}}}}}}}}s:4:\"type\";i:128;s:7:\"headers\";O:48:\