(5157, 299, 'sections_0_text_commitment_to_architectural', '<h3><strong>Commitment to Architectural design</strong> + our client’s needs.</h3>'),
(5158, 299, '_sections_0_text_commitment_to_architectural', 'field_668faf82874ff'),
(5159, 299, 'sections_0_paragraphp_text', 'We are consultative + can help you see a space when it’s invisible, provide suggestions, clarify options, and deliver quality, inspiring homes with spaces that will enhance your everyday lives.'),
(5160, 299, '_sections_0_paragraphp_text', 'field_668fafd487501'),
