(26364, 22, 'sections_2_image_heading_and_content_0_wysiwyg_editor_heading', '<h3><strong style=\"font-size: 16px;\">Details  </strong><a href=\"http://localhost/wp_architects/wp-content/uploads/2024/07/Icon1-phone-1.svg\"><img class=\"alignnone wp-image-486 size-full\" src=\"http://localhost/wp_architects/wp-content/uploads/2024/07/Icon1-phone-1.svg\" alt=\"\" width=\"19\" height=\"19\" /></a><a style=\"font-size: 16px;\">0415 951 241 </a> <a href=\"http://localhost/wp_architects/wp-content/uploads/2024/07/Icon1-mail.svg\"><img class=\"alignnone wp-image-487 size-full\" src=\"http://localhost/wp_architects/wp-content/uploads/2024/07/Icon1-mail.svg\" alt=\"\" width=\"16\" height=\"13\" /></a><a style=\"font-size: 16px;\">Email Luisa</a></h3>'),
