(26792, 489, 'sections_1_wysiwyg_editor', 'We are consultative and can help you see a space when it is invisible. We provide suggestions, clarity options, and deliver quality, inspiring homes with spaces that will enhance your everyday lives.\r\n\r\nWe assist residential property owners on Sydney’s Northern Beaches, Lower North Shore, Upper North Shore, Eastern Suburbs and the Inner West.\r\n\r\nOur services include: Prepurchase Advice, Concept Design, Design Development, Development Application, Construction Documentation, Contractor Selection, Contract Administration, and Interior Design.\r\n<ul>\r\n 	<li>Prepurchase Advice</li>\r\n 	<li>Concept Design</li>\r\n 	<li>Design Development</li>\r\n 	<li>Development Application</li>\r\n 	<li>Construction Documentation</li>\r\n 	<li>Contractor Selection</li>\r\n 	<li>Contract Administration</li>\r\n 	<li>Interior Design</li>\r\n</ul>'),
