(26898, 22, 'sections_2_image_heading_and_content_2_wysiwyg_editor_paragraph', 'Victoria studied a bachelor of Architecture in Bogota, Colombia. She moved to Australia in 2001 and then went onto study a diploma of Building Design at Tafe NSW where she learnt and familiarised herself with the Australian architectural standards.\r\n\r\nShe loves to travel around the world, experiencing all different cultures.\r\n\r\nResidential architecture is her passion, as she enjoys designing homes for her clients to love and enjoy.\r\n\r\nShe enjoys walks around Manly and loves the relaxing atmosphere and lifestyle of the Northern Beaches.'),
