(28610, 502, 'sections_1_wysiwyg_editor_heading', '<h3><strong>Commitment to Architectural design</strong> <span> + </span> our client’s needs.</h3>'),
(28611, 502, '_sections_1_wysiwyg_editor_heading', 'field_668faf82874ff'),
(28612, 502, 'sections_1_wysiwyg_editor_paragraph', 'We are consultative + can help you see a space when it’s invisible, provide suggestions, clarify options, and deliver quality, inspiring homes with spaces that will enhance your everyday lives.\r\n\r\nWe assist residential property owners on Sydney’s Northern Beaches, North Shore, Eastern Suburbs and Inner West, with everything from concept design through to complete interior design.'),
