(29072, 510, '_form', '<div class=\"row\">\n    <div class=\"col-lg-6\">\n        <div class=\"mb-margin\">\n            [text* first-name class:form-control placeholder \"* First Name\"]\n        </div>\n    </div>\n    <div class=\"col-lg-6\">\n        <div class=\"mb-margin\">\n            [text* last-name class:form-control placeholder \"* Last Name\"]\n        </div>\n    </div>\n    <div class=\"col-lg-6\">\n        <div class=\"mb-margin\">\n            [email* email class:form-control placeholder \"* E-mail Address\"]\n        </div>\n    </div>\n    <div class=\"col-lg-6\">\n        <div class=\"mb-margin\">\n            [tel* phone class:form-control placeholder \"* Phone\"]\n        </div>\n    </div>\n    <div class=\"col-lg-12\">\n        <div class=\"map-r\">\n            [select reason-for-contact class:contact-s \"Reason for contact\" \"Reason for contact\" \"Reason for contact\"]\n        </div>\n    </div>\n    <div class=\"col-lg-12 col-md-12 col-sm-12\">\n        <div class=\"mb-margin\">\n            [textarea message class:form-control placeholder \"Message\"]\n        </div>\n    </div>\n    <div class=\"col-lg-12\">\n        <div class=\"mb-margin\">\n            [text hear-about-us class:form-control placeholder \"How Did You Hear About Us?\"]\n        </div>\n    </div>\n    <p>* Mandatory fields</p>\n</div>\n\n[submit class:contact_button \"Submit\"]'),
