(30458, 500, 'sections_2_image_heading_and_content_1_wysiwyg_editor_heading', '<h3><strong>Details  </strong><a href=\"http://localhost/wp_architects/wp-content/uploads/2024/07/Icon1-phone-1.svg\"><img class=\"alignnone wp-image-486 size-full\" src=\"http://localhost/wp_architects/wp-content/uploads/2024/07/Icon1-phone-1.svg\" alt=\"\" width=\"19\" height=\"19\" /></a><a>0415 951 241 </a> <a href=\"http://localhost/wp_architects/wp-content/uploads/2024/07/Icon1-mail.svg\"><img class=\"alignnone wp-image-487 \" src=\"http://localhost/wp_architects/wp-content/uploads/2024/07/Icon1-mail.svg\" alt=\"\" width=\"16\" height=\"13\" /></a><a>Email Luisa</a></h3>'),
(30459, 500, '_sections_2_image_heading_and_content_1_wysiwyg_editor_heading', 'field_669757d13a268'),
(30460, 500, 'sections_2_image_heading_and_content_1_wysiwyg_editor_paragraph', 'Bachelor of Architecture (Deakin) 1986 / Nominated Architect NSW ARB NO 8352 Principal Design Practitioner PDP0000115 / Design Practitioner DEP0000321 / Class 2 Buildings (Multi Residential)\r\n\r\nDavid McCrae is co-founder and principal of M+M Architects.\r\n\r\nHaving obtained his Bachelor of Architecture from Deakin University, David is a registered architect in NSW with extensive experience with a variety of building types and sizes across Australia.\r\n\r\nDavid is actively involved in the architectural profession having acted as Chair of the Lower North Shore Architects Network and represented small architectural practices on the AIA NSW Chapter Council.\r\n\r\nHe volunteered to be a tour leader for the Sydney Skyscrapers Walk and the City Bar Tours organised by the Australian Architecture Association.\r\n\r\nDavid is also an active member of the local Northern Beaches community. He founded Mo Manly – a men’s monthly meet-up group committed to raising money for the Northern Beaches Women’s Shelter.'),
