(30935, 595, '_sections_1_image_and_content_repeater_1_wysiwyg_editor_content', 'field_6699fcd099c16'),
(30936, 595, 'sections_1_image_and_content_repeater_1_image', '592'),
(30937, 595, '_sections_1_image_and_content_repeater_1_image', 'field_6699fcde99c17'),
(30938, 595, 'sections_1_tab_content_repeater_0_image_and_content_repeater_0_main_heading', 'Prepurchase Advice'),
(30939, 595, '_sections_1_tab_content_repeater_0_image_and_content_repeater_0_main_heading', 'field_669a0a93dea5a'),
(30940, 595, 'sections_1_tab_content_repeater_0_image_and_content_repeater_0_wysiwyg_editor_content', 'Let MMJ Architects show you the potential a house or an apartment may have, so that prior to purchase you know your options and you can harness this for a more informed purchase that will suit your needs.\r\n\r\nWe’ll assist you to see more clearly, and select the right place for your current and future needs.\r\n\r\nBy viewing selected properties with you and offering constructive design ideas and suggestions including base sketching with real estate plans.'),
