(31118, 604, 'sections_1_image_and_content_repeater_1_wysiwyg_editor_content', 'We gain an understanding of your requirements and aspirations, then we conduct an assessment of the opportunities and constraints offered by the site.\r\n\r\nPreliminary authority regulations analysis and requirements are completed and then a number of sketch design options are explored with you reaching a preferred design solution.\r\n\r\nDrawings are detailed enough to obtain preliminary cost estimates from a Quantity Surveyor (QS) at the completion of this stage.'),
