INSERT INTO `wp_postmeta` (`meta_id`, `post_id`, `meta_key`, `meta_value`) VALUES
(31152, 604, 'sections_1_tab_content_repeater_2_image_and_content_repeater_0_wysiwyg_editor_content', 'Depending on cost outcomes prepared by the Quantity Surveyor, the preferred and approved sketch design option is developed into a final detailed design for the Development Application (DA) submission to Council, co- ordinating and integrating the design work undertaken by consultants with the architectural drawings.\r\n\r\nPre application meetings are organised with council and adjoining neighbours to facilitate the planning process and assist in obtaining approval.'),
(31153, 604, '_sections_1_tab_content_repeater_2_image_and_content_repeater_0_wysiwyg_editor_content', 'field_669a0aacdea5b'),
(31154, 604, 'sections_1_tab_content_repeater_2_image_and_content_repeater_0_image', '601'),
(31155, 604, '_sections_1_tab_content_repeater_2_image_and_content_repeater_0_image', 'field_669a0ae9dea5c'),
(31156, 604, 'sections_1_tab_content_repeater_3_image_and_content_repeater_0_main_heading', 'Development Application'),
(31157, 604, '_sections_1_tab_content_repeater_3_image_and_content_repeater_0_main_heading', 'field_669a0a93dea5a'),
(31158, 604, 'sections_1_tab_content_repeater_3_image_and_content_repeater_0_wysiwyg_editor_content', 'We will confirm statutory authority requirements, attend pre application meetings with relevant authorities prior to submission of formal application.\r\n\r\nWe will then prepare the application, including plans, diagrams, analyses, studies, reports and other information for the submission. If required, we will coordinate required Specialist Consultants on your behalf.\r\n\r\nAnd finally, we will assist you with the lodging of formal application and coordinate the preparation of an updated forecast of the Cost of Works.'),
(31159, 604, '_sections_1_tab_content_repeater_3_image_and_content_repeater_0_wysiwyg_editor_content', 'field_669a0aacdea5b'),
