(31255, 605, '_sections_1_tab_content_repeater_7_link_tab', 'field_6699fc7899c13'),
(31256, 605, 'sections_1_image_and_content_repeater_1_main_heading', 'Concept Design'),
(31257, 605, '_sections_1_image_and_content_repeater_1_main_heading', 'field_6699fcc499c15'),
(31258, 605, 'sections_1_image_and_content_repeater_1_wysiwyg_editor_content', 'We gain an understanding of your requirements and aspirations, then we conduct an assessment of the opportunities and constraints offered by the site.\r\n\r\nPreliminary authority regulations analysis and requirements are completed and then a number of sketch design options are explored with you reaching a preferred design solution.\r\n\r\nDrawings are detailed enough to obtain preliminary cost estimates from a Quantity Surveyor (QS) at the completion of this stage.'),
(31259, 605, '_sections_1_image_and_content_repeater_1_wysiwyg_editor_content', 'field_6699fcd099c16'),
(31260, 605, 'sections_1_image_and_content_repeater_1_image', '592'),
