(31395, 609, '_sections_1_tab_content_repeater_7_link_tab', 'field_6699fc7899c13'),
(31396, 609, 'sections_1_image_and_content_repeater_1_main_heading', 'Concept Design'),
(31397, 609, '_sections_1_image_and_content_repeater_1_main_heading', 'field_6699fcc499c15'),
(31398, 609, 'sections_1_image_and_content_repeater_1_wysiwyg_editor_content', 'We gain an understanding of your requirements and aspirations, then we conduct an assessment of the opportunities and constraints offered by the site.\r\n\r\nPreliminary authority regulations analysis and requirements are completed and then a number of sketch design options are explored with you reaching a preferred design solution.\r\n\r\nDrawings are detailed enough to obtain preliminary cost estimates from a Quantity Surveyor (QS) at the completion of this stage.'),
(31399, 609, '_sections_1_image_and_content_repeater_1_wysiwyg_editor_content', 'field_6699fcd099c16'),
(31400, 609, 'sections_1_image_and_content_repeater_1_image', '592'),
(31401, 609, '_sections_1_image_and_content_repeater_1_image', 'field_6699fcde99c17'),
(31402, 609, 'sections_1_tab_content_repeater_0_image_and_content_repeater_0_main_heading', 'Prepurchase Advice'),
(31403, 609, '_sections_1_tab_content_repeater_0_image_and_content_repeater_0_main_heading', 'field_669a0a93dea5a'),
(31404, 609, 'sections_1_tab_content_repeater_0_image_and_content_repeater_0_wysiwyg_editor_content', 'Let MMJ Architects show you the potential a house or an apartment may have, so that prior to purchase you know your options and you can harness this for a more informed purchase that will suit your needs.\r\n\r\nWe’ll assist you to see more clearly, and select the right place for your current and future needs.\r\n\r\nBy viewing selected properties with you and offering constructive design ideas and suggestions including base sketching with real estate plans.'),
(31405, 609, '_sections_1_tab_content_repeater_0_image_and_content_repeater_0_wysiwyg_editor_content', 'field_669a0aacdea5b'),
