(31483, 609, '_sections_1_tab_content_repeater_4_image', 'field_669a106f3da16'),
(31484, 609, 'sections_1_tab_content_repeater_5_main_heading', ' Contractor Selection'),
(31485, 609, '_sections_1_tab_content_repeater_5_main_heading', 'field_669a10443da14'),
(31486, 609, 'sections_1_tab_content_repeater_5_wysiwyg_editor_content', 'To help you engage the right builder, we offer a Contract Selection service based on a tender process.\r\n\r\nWe prepare tender documents and issue them to the relevant builders, we respond to their enquiries. We receive and open the tenders. We assess the tenders and we negotiate to obtain an offer that is acceptable to you.\r\n\r\nFinally, we prepare reports on the tenders received and we make our recommendation to you.'),
(31487, 609, '_sections_1_tab_content_repeater_5_wysiwyg_editor_content', 'field_669a105d3da15'),
(31488, 609, 'sections_1_tab_content_repeater_5_image', '611'),
(31489, 609, '_sections_1_tab_content_repeater_5_image', 'field_669a106f3da16'),
(31490, 609, 'sections_1_tab_content_repeater_6_main_heading', ' Contract Administration'),
(31491, 609, '_sections_1_tab_content_repeater_6_main_heading', 'field_669a10443da14'),
(31492, 609, 'sections_1_tab_content_repeater_6_wysiwyg_editor_content', 'After tendering process and negotiations with approved builder are complete, Construction documents are further developed into Contract documents between the client and builder.\r\n\r\nWe can administer the contract between the client and builder, ensuring the design quality is maintained throughout project construction, ensuring what is built matches what was drawn and specified.\r\n\r\nThis phase will also included regular site visits and meetings, and certification of builder payments.'),
(31493, 609, '_sections_1_tab_content_repeater_6_wysiwyg_editor_content', 'field_669a105d3da15'),
(31494, 609, 'sections_1_tab_content_repeater_6_image', '612'),
