(31498, 609, 'sections_1_tab_content_repeater_7_wysiwyg_editor_content', 'We can provide the following additional services on an individual basis or as part of your overall home design works:\r\n<ul>\r\n 	<li>Joinery Design</li>\r\n 	<li>Kitchen Cabinetry</li>\r\n 	<li>bedroom wardrobes</li>\r\n 	<li>general storage</li>\r\n 	<li>living room cabinetry</li>\r\n 	<li>dining room cabinetry</li>\r\n 	<li>display cupboard and shelving</li>\r\n</ul>\r\nFixture and fittings schedules Selection of all wall, floor and ceiling colours, finishes, and material with all light and fixtures, door hardware and window finishes.'),
