(31576, 614, 'sections_1_tab_content_repeater_7_image_and_content_repeater', ''),
(31577, 614, '_sections_1_tab_content_repeater_7_image_and_content_repeater', 'field_669a0a79dea59'),
(31578, 614, 'sections_1_tab_content_repeater_2_image_and_content_repeater_0_main_heading', 'Design Development'),
(31579, 614, '_sections_1_tab_content_repeater_2_image_and_content_repeater_0_main_heading', 'field_669a0a93dea5a'),
(31580, 614, 'sections_1_tab_content_repeater_2_image_and_content_repeater_0_wysiwyg_editor_content', 'Depending on cost outcomes prepared by the Quantity Surveyor, the preferred and approved sketch design option is developed into a final detailed design for the Development Application (DA) submission to Council, co- ordinating and integrating the design work undertaken by consultants with the architectural drawings.\r\n\r\nPre application meetings are organised with council and adjoining neighbours to facilitate the planning process and assist in obtaining approval.'),
(31581, 614, '_sections_1_tab_content_repeater_2_image_and_content_repeater_0_wysiwyg_editor_content', 'field_669a0aacdea5b'),
(31582, 614, 'sections_1_tab_content_repeater_2_image_and_content_repeater_0_image', '601'),
(31583, 614, '_sections_1_tab_content_repeater_2_image_and_content_repeater_0_image', 'field_669a0ae9dea5c'),
(31584, 614, 'sections_1_tab_content_repeater_3_image_and_content_repeater_0_main_heading', 'Development Application'),
(31585, 614, '_sections_1_tab_content_repeater_3_image_and_content_repeater_0_main_heading', 'field_669a0a93dea5a'),
(31586, 614, 'sections_1_tab_content_repeater_3_image_and_content_repeater_0_wysiwyg_editor_content', 'We will confirm statutory authority requirements, attend pre application meetings with relevant authorities prior to submission of formal application.\r\n\r\nWe will then prepare the application, including plans, diagrams, analyses, studies, reports and other information for the submission. If required, we will coordinate required Specialist Consultants on your behalf.\r\n\r\nAnd finally, we will assist you with the lodging of formal application and coordinate the preparation of an updated forecast of the Cost of Works.'),
(31587, 614, '_sections_1_tab_content_repeater_3_image_and_content_repeater_0_wysiwyg_editor_content', 'field_669a0aacdea5b'),
(31588, 614, 'sections_1_tab_content_repeater_3_image_and_content_repeater_0_image', '602'),
(31589, 614, '_sections_1_tab_content_repeater_3_image_and_content_repeater_0_image', 'field_669a0ae9dea5c'),
(31590, 614, 'sections_1_tab_content_repeater_4_image_and_content_repeater_0_main_heading', 'Construction Documentation'),
(31591, 614, '_sections_1_tab_content_repeater_4_image_and_content_repeater_0_main_heading', 'field_669a0a93dea5a'),
(31592, 614, 'sections_1_tab_content_repeater_4_image_and_content_repeater_0_wysiwyg_editor_content', 'Development Application (DA) is developed into detailed drawings, schedules and specifications to ensure the sketch concept design intent is retained during construction.\r\n\r\nConsultants works are coordinated and integrated with drawings, schedules, reports and specifications for Construction Certificate submission to Council, and then tendering to builders and ultimately construction.'),
(31593, 614, '_sections_1_tab_content_repeater_4_image_and_content_repeater_0_wysiwyg_editor_content', 'field_669a0aacdea5b'),
