(31631, 614, '_sections_1_tab_content_repeater_4_image', 'field_669a106f3da16'),
(31632, 614, 'sections_1_tab_content_repeater_5_main_heading', ' Contractor Selection'),
(31633, 614, '_sections_1_tab_content_repeater_5_main_heading', 'field_669a10443da14'),
(31634, 614, 'sections_1_tab_content_repeater_5_wysiwyg_editor_content', 'To help you engage the right builder, we offer a Contract Selection service based on a tender process.\r\n\r\nWe prepare tender documents and issue them to the relevant builders, we respond to their enquiries. We receive and open the tenders. We assess the tenders and we negotiate to obtain an offer that is acceptable to you.\r\n\r\nFinally, we prepare reports on the tenders received and we make our recommendation to you.'),
(31635, 614, '_sections_1_tab_content_repeater_5_wysiwyg_editor_content', 'field_669a105d3da15'),
(31636, 614, 'sections_1_tab_content_repeater_5_image', '611'),
(31637, 614, '_sections_1_tab_content_repeater_5_image', 'field_669a106f3da16'),
(31638, 614, 'sections_1_tab_content_repeater_6_main_heading', ' Contract Administration'),
(31639, 614, '_sections_1_tab_content_repeater_6_main_heading', 'field_669a10443da14'),
(31640, 614, 'sections_1_tab_content_repeater_6_wysiwyg_editor_content', 'After tendering process and negotiations with approved builder are complete, Construction documents are further developed into Contract documents between the client and builder.\r\n\r\nWe can administer the contract between the client and builder, ensuring the design quality is maintained throughout project construction, ensuring what is built matches what was drawn and specified.\r\n\r\nThis phase will also included regular site visits and meetings, and certification of builder payments.'),
(31641, 614, '_sections_1_tab_content_repeater_6_wysiwyg_editor_content', 'field_669a105d3da15'),
(31642, 614, 'sections_1_tab_content_repeater_6_image', '612'),
(31643, 614, '_sections_1_tab_content_repeater_6_image', 'field_669a106f3da16'),
(31644, 614, 'sections_1_tab_content_repeater_7_main_heading', ' Interior Design'),
(31645, 614, '_sections_1_tab_content_repeater_7_main_heading', 'field_669a10443da14'),
(31646, 614, 'sections_1_tab_content_repeater_7_wysiwyg_editor_content', 'We can provide the following additional services on an individual basis or as part of your overall home design works:\r\n<ul>\r\n 	<li>Joinery Design</li>\r\n 	<li>Kitchen Cabinetry</li>\r\n 	<li>bedroom wardrobes</li>\r\n 	<li>general storage</li>\r\n 	<li>living room cabinetry</li>\r\n 	<li>dining room cabinetry</li>\r\n 	<li>display cupboard and shelving</li>\r\n</ul>\r\nFixture and fittings schedules Selection of all wall, floor and ceiling colours, finishes, and material with all light and fixtures, door hardware and window finishes.'),
(31647, 614, '_sections_1_tab_content_repeater_7_wysiwyg_editor_content', 'field_669a105d3da15'),
