(33318, 631, '_sections_1_small_heading', 'field_668faf5d874fe'),
(33319, 631, 'sections_1_wysiwyg_editor_heading', '<h3><strong>Commitment to Architectural design</strong>  <span>+</span>  our client’s needs.</h3>'),
(33320, 631, '_sections_1_wysiwyg_editor_heading', 'field_668faf82874ff'),
